var book = {
	"name": "ရိမၫ",
	"numChapters": 16,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> ယ့ၫရှူၬဎရံၬ အခ့ၫအၡၩ, ၦဆၧအၪ့မၧၫ့ဖိၪလၧ ဆၧကိၭဝ့ၫ, ၦဘၪဆၧအၪ့နၩ့ဖၭဝ့ၫ လၧယွၩအဆၧ",
			"2": "<sup>2</sup> ၥၭထိၬအပရၧၫ့အဂး,- လၧဆၧစံၭဝဲၩဝ့ၫ လၧမီၪလ",
			"3": "<sup>3</sup> ဖၪလၧလံၬဆံၫ့ဎံၪအဖၧၩ့,- လၧအဖိၪခွၫ ပကဆါယ့ၫ",
			"4": "<sup>4</sup> ရှူၬဎရံၬအဂဲး,- လၧဆၧဖံၭဆၧယၪအဖၧၩ့နီၪ, စဒၫဝံၭ အချံၫအၥၪ,ဒဲလၧၥၭမုဆံၫ့ဎံၪအကၠီၩ့နီၪ ဆၧဒုၭဖျီၪ ထၪ့လၧအမွဲယွၩအဖိၪခွၫအီၪလၧအစီၩ့အမၩ့ လၧ",
			"5": "<sup>5</sup> အဂဲထုၪ့လၧဆၧၥံၫအဖၧၩ့နီၪ,- တၭပန့ဘၪဆၧအခိး အတၩ,ဒဲဆၧအၪ့မၧၫ့ဖိၪအလး လၧအဝ့ၫဒၪလၧဆၧ ခိၭနၪဘၪဆဲၫ့လၧဆၧနဲၩလၧကယဲၦအဆၨၩထီးအ",
			"6": "<sup>6</sup> လူၬအကျၩအဂးလၧအဝ့ၫဒၪအမံၩ့အကၠီၩ့,- လၧအ ဝ့ၫၥံၪအကျၩနၥံၪဝ့ၫဒၪယီၩ, နၥံၪမွဲၦလၧ ယ့ၫရှူၬဎရံၬ",
			"7": "<sup>7</sup> ကိၭဝ့ၫဆ့,- ယၧၩ, စပီလူၫလဂၩစံၭ ၦလၧယွၩအဲၪဝ့ၫ လဖၪ, လၧဆၧကိၭဝဲၩဝ့ၫလၧၦဆံၫ့ဎံၪလၧအအီၪလၧ ရိမၫအဖၧၩ့ထီးအလူၬနီၪ, မွဲဆၧအခိးအတၩ,ဒဲဆၧ ဘၪလိၬအိၭလိၬ လၧပဖါယွၩ, ဒဲကဆါယ့ၫရှူၬဎရံၬနီၪ, မွဲအဘၪဒၪဝ့ၫနၥံၪဆံၭ.",
			"8": "<sup>8</sup> လၧအခၪ့ထံၭလဖၧၫ့ယီၩ, ယစံၭထၪ့အၪ့အူၭယ ယွၩအခိးအတၩ လၧယ့ၫရှူၬဎရံၬအကၠီၩ့ လၧနၥံၪကိၭ ဂၩဒ့ၭအဂးတၭ, အဂဲးဘဲၫယီၩ နၥံၪအဆၧနဲၩဂၧၫ့ထၪ့",
			"9": "<sup>9</sup> ၥၩလၩ့လၧဂၪ့ခိၪချိၫ့ထၧၫ့ဖျိၪ့ယၫလီၫ.- အဂဲးဘဲၫ ယီၩယွၩလၧယမၩအဆၧလၧယၥၭ, လၧအဖိၪခွၫ အဆၧၥၭထိၬ အပရၧၫ့အဖၧၩ့လဂၩနီၪ, မွဲအထိးအၥၭ လၧယဂး, လၧယနၪ့ထၪ့ထဲၩ့နၥံၪ လၧယဆၧဘၩဆိၪ",
			"10": "<sup>10</sup> ဖၪအဖၧၩ့လထံၪဎး,- ဒဲယအၪ့ကံၩ့ဆၧဘဲၫၥိၭအ့ၪ ၥ့ၪနီၪ,လယံၬလမီဘၪ, အ့ၪဘၪယွၩအၥၭတၭ, ယမိ",
			"11": "<sup>11</sup> လ့ၩရှူၪလ့ၩမုၬထီၩ့လၧနၥံၪအအီၪလီၫ.- အဂဲးဘဲၫ ယီၩဆၧမိဒၪဘၪယၥၭလၧနၥံၪ,ဘဲၫၥိၭယမိဖ့ၪလၫ့ နၥံၪလၧဆၧအခိးအတၩလမံၩ့မံၩ့ဘၪဆဲၫ့လၧၥၭ",
			"12": "<sup>12</sup> လၧနၥံၪမိအီၪဂုးခၧၫ့ အဂးလီၫ.- ဘဲၫၦစံၭဆၧအၥိၭ လၧယမိဘၪ ဆၧမၩမုၬထၪ့ထဲၩ့ယၧၩ လၧနၥံၪအၥိၭ, လၧဆၧနဲၩဘၪဆဲၫ့လၧနၥံၪ,ဒဲယၧၩလါခီၫလူၬလီၫ.",
			"13": "<sup>13</sup> ဖုၥံၪဝဲၥံၪဧ့, ဘဲၫၥိၭယမိန့ဘၪ ဆၧၥၪလမံၩ့မံၩ့လၧ နၥံၪအကျၩ, ဘဲၫလၧၦဆၨၩလဖၪ အကျၩအၥိၭနီၪ, ယစ့ၩရၫ့ဝဲၩယၥၭ ဆိၫဆိဆိၫဆိ လၧယမိလ့ၩထီၩ့လၧ နၥံၪအအီၪတၭ, မွဲယအီၪက့ၪယၥၭ ဘဲၫနၥံၪလၥ့ၪယၫ ဘၪအၥိၭနီၪမွဲအ့ၬ. မွဲလါနၫ့ဘိၩ ဆၧမၩထံၬထၬယၧၩ",
			"14": "<sup>14</sup> ခီးဘိၩ့နဲၪ့ယီၩလီၫ.- ၦဂြံစၭဖိၪၥံၪမွဲဂ့ၩ, ၦမံၩ့လၬကျၩ ဖိၪၥံၪမွဲဂ့ၩ, ၦကိၪ့ၥ့ၪမွဲဂ့ၩ, ၦကိၪ့လၥ့ၪဘၪမွဲဂ့ၩ,ယ",
			"15": "<sup>15</sup> မါအီၪလၧအလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,လၥ့ၪ ထီးဒၪယၥ့ၪနီၪ, ယမိလီၩလၩ့လၬလၩ့ ဆၧၥၭထိၬအ ပရၧၫ့လၧနၥံၪအမ့ၬယၫ လၧရိမၫအဖၧၩ့နီၪ ဆ့လီၫ.",
			"16": "<sup>16</sup> အဂဲးဘဲၫယီၩ လၧဆၧၥၭထိၬအပရၧၫ့အကၠီၩ့နီၪ, ယ မ့ၬမဲအ့ၬ. အဂဲးဘဲၫယီၩမွဲယွၩအစီၩ့အမၩ့လၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့ ကယဲၦလၧအနဲၩထဲၩ့ ဆၧကိၭ ဂၩဒ့ၭအဂး, ၦယုဒၫဖိၪလၧအဆိၩ,ဒဲၦဂြံစၭဖိၪဆ့",
			"17": "<sup>17</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယွၩအဆၧတီၩဆၧလီၩ့ အီၪဖျီၪ ဝ့ၫလၧအဖၧၩ့နီၪ,လၧဆၧနဲၩဖိးလၧဆၧနဲၩ,ဘဲၫဆၧ ကွ့ၭအၥၭအၥိၭနီၪ, ၦ တီၩ ၦ လီၩ့ ယီၩ မိ မၧၫ့ ဝ့ၫ လၧ ဆၧ နဲၩ လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ၦၡၩအဆၧမၩလယူၭလယၪ့ဘၪ ယွၩ, ဒဲအဆၧလတီၩလလီၩ့ဘၪထီးအလူၬလၧအဖီၪ့ ထၬဆၧမွဲဆၧတီၩ လၧဆၧလတီၩလလီၩ့ဘၪအဖၧၩ့နီၪ, ယွၩအဆၧၥၭထၪ့အီၪဖျီၪ လၧမူၭခိၪလခီၫ ထၫ့ဒုၪဒၩ",
			"19": "<sup>19</sup> ဝ့ၫတၭ,ဘၪလၧအဝ့ၫၥံၪအလီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ဆၧၥ့ၪယၫယွၩ အီၪဖျီၪလၧအကျၩလီၫ. မွဲယွၩမၩဖျီၪ",
			"20": "<sup>20</sup> ထၪ့လၧအဝ့ၫၥံၪလီၫ.- အဂဲးဘဲၫယီၩလၧဂၪ့ခိၪဘၪ ဆၧမၩကဲၪထၪ့ဝ့ၫ လၧဖျိၩ့လံၩလံၩ ခီးဘိၩ့နဲၪ့ယီၩ, ဆၧဒၪဘၪအဆၧလအီၪဖျီၪဘၪလဖၪ လၩ့ထံးလၩ့ ဆ့ၭတၭ, ၦၥ့ၪယၫဝ့ၫလၧဆၧဘၪကဲၪထၪ့ဝ့ၫ လဖၪအ ကၠီၩ့နီၪ,အစီၩ့အမၩ့အဆိၩအကၠၪဒၪလ့ၬ, ဒဲယွၩ အၡီၩ့လဂၩဆ့တၭ, မွဲဘဲၫၥိၭအမိချဲၩ့ဖီၩ့ဖျ့ၭ ဆၧအ လးထီးအီၪလဂ့ၩအဂဲးလီၫ.",
			"21": "<sup>21</sup> အဂဲးဘဲၫယီၩ လၧအၥ့ၪယၫယွၩနီၪ, မွဲအလမၩလၩ မၩဖၩ့ဘၪဝ့ၫဘဲၫယွၩအၥိၭနီၪ,ဒဲလမၩၥ့ၪယၫလၩ့ ဘၪအၥၭလၧအခိးအတၩနီၪ, အ့ၪမွဲအကိၪ့ထၪ့ဖၭ လၩ့ဆၧ ပျီၩပျီၩတၭ, အၥုၪ့ဂၭဂီၩ့အၥၭဂၭစၪနီၪခံၭ",
			"22": "<sup>22</sup> လၩ့ဝ့ၫဒၪလီၫ.- စံၭလၩ့အၥၭ လၧအမွဲၦကိၪ့ၥ့ၪတၭ,",
			"23": "<sup>23</sup> ကဲၪထၪ့ဝ့ၫလၧၦအဂီၩ့လီၫ.- ယွၩလၧအလအုၪလ ၥံၫဘၪအလၩအဖၩ့နီၪ, အဝ့ၫၥံၪအၪ့လဲၩခွံၬဝ့ၫ လၧ ဆၧဂၩ့ဆၧဖၪ့အလး လၧအလၩ့ဂၬၦၡၩအအုၪၥ့ၪ, ဒဲ ထိၪၥံၪလံၪၥံၪ, ဒဲဆၧအီၪလၧအခၪ့လံခီၫ, ဒဲဆၧစွၩၥ့ၪ",
			"24": "<sup>24</sup> လဖၪနီၪလီၫ.- အခိးမွဲဘဲၫနီၪတၭ, ယွၩဖ့ၪလၫ့ခွံၬ အ ဝ့ၫၥံၪလၧဆၧၥၭလဲး ၥၭဘျၪအဖၧၩ့,လၧဆၧအဲၪ ဘျံၭအဲၪဘျၪအဖၧၩ့, ဘဲၫၥိၭအမိမၩ ဂၭဂီၩ့လၩ့အနၫ့",
			"25": "<sup>25</sup> ဆါဒၪဝ့ၫအလၩအဖၩ့လီၫ.- အဝ့ၫၥံၪအၪ့လဲၩခွံၬယွၩ အဆၧမွဲဆၧတီၩ လၧဆၧအဘျံၭအဘျၪ အလးနီၪ, ဆၧလၧအဘၪကဲၪထၪ့ဝ့ၫနီၪ,မွဲအဘိၪ့ထၪ့ဘၩထၪ့ ဝ့ၫတၭ, ဒဲမၩအဆၧအၪနဲၪ့ ၦလၧအမၩကဲၪထၪ့ဆၧ လဂၩ, လၧအဘၪဆၧဆိၪဂ့ၩ အဆိၩဆိၩအကၠၪကၠၪ ဆ့လီၫ. အၩမံၩ့.",
			"26": "<sup>26</sup> ဆၧမၩအၥၭဘဲၫနီၪတၭ, ယွၩဖ့ၪလၫ့ခွံၬ အဝ့ၫၥံၪ လၧဆၧလဲးဆၧဘျၪအအၧၩ့အဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩၦမုၪလဖၪ လမၩဘၪဆၧအထူၫအရူၫတၭ, အၪ့ လဲၩခွံၬဝ့ၫ လၧဆၧလၧအထၫ့ဒုၪဒၩ အထူၫအရူၫနီၪ",
			"27": "<sup>27</sup> အလးလီၫ.- ဘဲၫနီၪအၥိၭ ၦခွၫမၩၦမုၪ ဘဲၫအထူၫအ ရူၫအၥိၭနီၪ ခွံၬၡိၭခွံၬဝ့ၫတၭ, အၥၭခတၧၩလိၬအၥၭ ၦခွၫခီၫၦခွၫတၭ,မၩဆၧလၧၦမ့ၬမဲဝ့ၫနီၪ, အဝ့ၫၥံၪအ ဆၧမၪအဆၧဖ့ၪဆၧၫ့ လၧအကြၨၭဘၪဝ့ၫနီၪ ဒိၭန့ဝ့ၫ",
			"28": "<sup>28</sup> လၧအဖၧၩ့ဒၪဝ့ၫလီၫ.- မွဲဆၧလမိအီၪဘၪအၥၭ လၧ ဆၧၥ့ၪယၫယွၩအဖၧၩ့နီၪ, ယွၩဖ့ၪလၫ့ခွံၬဝ့ၫ လၧဆၧ ၥၭအၧၩ့အဖၧၩ့ ဘဲၫၥိၭအမိမၩဆၧလဘၪဘၪလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫၥံၪလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫ လၧကယဲဆၧလတီၩလ လီၩ့ဘၪ, ဆၧမၩမၪမုၪမၩမၪခွၫ, ဆၧၥၭဆ့ၭအ့ၭ, ဆၧ လီၫ့ကီၩ့ၥၭကွံၩ, ဆၧမၩအၧၩ့ဆၧလီၫ. လၧၫ့ထၪ့ဎွ့ၩ ထၪ့ဝ့ၫလၧဆၧၥၭခ့ၬ, ဆၧမၩၥံၪၦၡၩ, ဆၧအဲၪ့လိၬဆိၭ ချဲၩ့,ဆၧအၪ့ဝံၩအၪ့လီၫ, ဆၧၥုၪ့ထၪ့ၥၭဂဲၫ့, ဆၧၥူၭဝံၪ",
			"30": "<sup>30</sup> ၥူၭလၩ,- ၦချဲၩ့ခဲၪဆၧ,ၦၥၭဂဲၫ့ယွၩ, ၦဒုၪဒွ့ၪဆၧ, ၦ အီၪက့ၪထၪ့ထီၫအၥၭ, ၦမၩဖိၫလိၫအၥၭ, ၦမၩအၪ ထၪ့ဆၧအၧၩ့ဆၧၥၫ့, ၦလၧအလခိၭနၪဘၪအမိအဖါ,",
			"31": "<sup>31</sup> ၦအၥၭကၪ,ၦလမၩတီၩဘၪအလူ, ၦလအဲၪဘၪအ ဘူၭအထံး,ၦအၥုၪ့လခါအၥၭလလၩ့ဘၪ, ၦလယၫ့ ၥၭဘၪဆၧတၭ, ယွၩအဆၧစ့ၩရၫ့အဝ့ၫၥံၪၥ့ၪယၫလၩ့",
			"32": "<sup>32</sup> ထံးလၩ့ဆ့ၭ,- လၧၦမၩဆၧဘဲၫနီၪအၥိၭလဖၪ, ကြၨၭ ဘၪၥံၫလါနၫ့ဘိၩ မၩန့ၫဆၧနီၪလဖၪလကၭလၧၩ့တၭး အ့ၪမွဲၦမၩဝ့ၫလဖၪနီၪ, မွဲအမုၬအၥၭလၧအၥိၭဆ့လီၫ."
		},
		"2": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအစ့ၩရၫ့ဆၧလဂၩလါ လါ, ၦၡၩဧ့, နချဲၩ့ဖီၩ့ဖျ့ၭဆၧအလးအီၪအ့ၬ. အဂဲး ဘဲၫယီၩဆၧလၧနစ့ၩရၫ့အီၪက့ၪလၧၦဂူၫဂၩအလီၩ့ နီၪ,မွဲနစ့ၩရၫ့စၪ နနၫ့ဆါဒၪနဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ၦလၧအစ့ၩရၫ့ဆၧနဝ့ၫဒၪယီၩ, နမၩဆၧမီၪ့ဎီၩ့လီၫ.",
			"2": "<sup>2</sup> ပၥ့ၪယၫလၧယွၩအဆၧစ့ၩရၫ့မွဲအတီၩအလီၩ့, ဘၪ",
			"3": "<sup>3</sup> ၦလၧအမၩဘဲၫနီၪအၥိၭအလီၩ့လီၫ.- ၦလၧအစ့ၩရၫ့ ၦမၩဆၧဘဲၫနီၪၥိၭလဖၪ, မၩဝ့ၫမီၪ့ဎီၩ့လဂၩဧ့,မွဲန",
			"4": "<sup>4</sup> ဆီၫ့မီၪ့လၧနမိဖီၩ့ဖျ့ၭယွၩအဆၧစ့ၩရၫ့စၪဆ့ဧၪ.- မွဲန လၥ့ၪယၫဘၪလၧယွၩ အခိးအတၩၥိၫ့နၧၩလၧဆၧနီၫ့ ယါလၩ့ထဲၩ့နၥၭအဖၧၩ့နီၪ, ယွၩအခိးအတၩ လၧၫ့ ဎွ့ၩ, ဒဲအၥုၪ့ဆၧၩ့ၥၭဆၧၩ့ ဒဲအဆၧအွံၪၥၭဆၧၩ့ ယံၬ",
			"5": "<sup>5</sup> ယံၬနီၪ, မွဲနအီၪက့ၪလၧဆၧနးမံၩ့အ့ၬဧၪ.- အ့ၪမွဲလၧ နၥၭနီၩ့, ဒဲလၧနလနီၫ့ယါလၩ့ထဲၩ့ဘၪနၥၭအကၠီၩ့နီၪ နအီၪက့ၪကီၪ့ဝဲၩဆၧၥၭထၪ့လၧနဂးဒၪနဝ့ၫလၧဆၧ ၥၭထၪ့အမုနံၩအဖၧၩ့, ဒဲယွၩအဆၧစ့ၩရၫ့တီၩမိအီၪ",
			"6": "<sup>6</sup> ဖျီၪဝ့ၫဆ့လီၫ.- အဝ့ၫဒၪမိဖ့ၪလၫ့ဆၧလၧၦၡၩဘဲၫအ",
			"7": "<sup>7</sup> မၩဒၪဆၧအၥိၭဆုၬဆုၬတၭး- ၦလၧအအၪ့ဎၬဆၧ လၩဆၧဖၩ့, ဒဲဆၧလအုၪလၥံၫဘၪ,လၧဆၧအွံၪၥၭ ဆၧၩ့မၩဆၧဂ့ၩလဖၪအဖၧၩ့နီၪ, ဎမိဖ့ၪလၫ့ဝ့ၫလၧၭဆၧ",
			"8": "<sup>8</sup> မၧၫ့အဆိၩအကၠၪလီၫ.- အ့ၪမွဲၦလၧအဂဲးလိၬတ့ၭ လိၬ,ဒဲလခိၭနၪဘၪဆၧမွဲဆၧတီၩတၭ, ခိၭနၪဆၧလ တီၩလလီၩ့ဘၪလဖၪနီၪ,ဎမိဖ့ၪလၫ့ဝ့ၫလၧၭဆၧၥၭထၪ့",
			"9": "<sup>9</sup> ဒဲဆၧၥၭခဲၩထၪ့ဝ့ၫလီၫ.- တၭဆၧနၭဆၧၡၪ့ ဆၧကၪ ဆၧဂဲၩမိအီၪ လၧကယဲၦၡၩ လၧအမၩဆၧအၧၩ့လဂၩ လါလါအလီၩ့နီၪ, ၦယုဒၫဖိၪလၧအဆိၫ, ဒဲၦဂြံစၭဖိၪ",
			"10": "<sup>10</sup> ဆ့လီၫ.- အ့ၪမွဲဆၧလၩဆၧဖၩ့,ဒဲဆၧယူၭဆၧယၪ့, ဒဲဆၧဘၪလိၬအိၭလိၬ မိအီၪလၧကယဲၦလၧအမၩဆၧ ဂ့ၩလဂၩလါလါအလီၩ့နီၪ, ၦယုဒၫဖိၪလၧအဆိၫ,ဒဲၦ ဂြံစၭဖိၪဆ့လီၫ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ ယွၩလယိဒိၪဆံၭအၪၡၩဘၪၦၡၩ",
			"12": "<sup>12</sup> လီၫ.- အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧအလအီၪဘၪ လၧ ဆၧမၪလူၬတၭ, မၩဒဲၩဘၭဆၧလဖၪနီၪ, မွဲအမိဘၪဆၧ ဂၭဂီၩ့ဂၭစၪ လၧအလဘၪဆဲၫ့ဘၪ လၧဆၧမၪလူၬနီၪ, ဒဲထီးဒၪၦလၧအမၩဒဲၩဘၭဆၧ လၧဆၧမၪလူၬအဖၧၩ့ လဖၪနီၪ, မိဘၪဆၧစ့ၩရၫ့ လၧဆၧမၪလူၬအဖၧၩ့နီၪ,",
			"13": "<sup>13</sup> (အဂဲးဘဲၫယီၩ ၦလၧအနါဂၧၫ့ဆၧမၪလူၬလဖၪနီၪ, မွဲ အတီၩအလီၩ့လၧယွၩအမ့ၬယၫအ့ၬ. အ့ၪမွဲၦလၧ အထီးန့ဖံၭထၬ ဆၧမၪလူၬလဖၪ မိဘၪဆၧတီၩ ဆၧ",
			"14": "<sup>14</sup> လီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ထီးၦဆၨၩလဖၪ လၧအလ အီၪဘၪလၧဆၧမၪလူၬနီၪ, အ့ၪထီးန့ဒၪဆၧမၪလူၬလၧ အထူၫအရူၫအဖၧၩ့နီၪတၭ, ဆၧမၪလူၬလအီၪဘၪ တၭ,အဝ့ၫၥံၪနီၪ, မွဲအကဲၪဆၧမၪလူၬလၧအဂးဒၪ",
			"15": "<sup>15</sup> ဝ့ၫလီၫ.- အဝ့ၫၥံၪအကၪ့ၡၧၫ့ထိးဒၪအၥၭ, ဆၧဒဲၩဘၭ မွဲဂ့ၩ,ဆၧမၩဖီၩ့ဖျ့ၭမွဲဂ့ၩ, အဆၧဆီၫ့မီၪ့ဝဲၩဒၪဝ့ၫလၧ အလီၩဘၪလါခီၫလါခီၫနီၪ ဒုၭနဲၪဝ့ၫလၧဆၧမၪလူၬ",
			"16": "<sup>16</sup> အဆၧမၩအီၪကွ့ၭအၥၭလၧအၥၭအလီၩ့လီၫ.)- လၧ မုလနံၩအထးဖၧၩ့ လၧယွၩမိစ့ၩရၫ့ၦၡၩအဆၧအီၪၥူၪ လဖၪလၧယ့ၫရှူၬဎရံၬ အစူၪဖၧၩ့, ဘဲၫယဆၧၥၭ ထိၬအပရၧၫ့အၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> အ့ၪမွဲဆၧအ့ၪကိၭနၧၩလၧၦယုဒၫဖိၪတၭ, နအ့ၪ ဒိၭနဲၩ့နၥၭ လၧဆၧမၪလူၬနီၪတၭ, နမၩဖိၫလိၫထၪ့နၥၭ",
			"18": "<sup>18</sup> လၧယွၩအဖၧၩ့နီၪ,- နအ့ၪၥ့ၪယၫအၥၭတၭ, န အ့ၪဘၪ ဆၧၥီၪ့လိၪ လၧဆၧမၪလူၬနီၪ, နအၪ့နၩ့ဖၭ",
			"19": "<sup>19</sup> ဆၧလၩ့မဲၩလဖၪအဆၧအ့ၪၥ့ၪတၭ,- နအ့ၪနဲၩလၩ့ နၥၭလၧနမွဲၦၥိၫ့ၦမ့ၬဘျီၪ, နအ့ၪမွဲဆၧဖၩ့ လၧၦအီၪ",
			"20": "<sup>20</sup> လၧဆၧခံးကျၩအဂးတၭ,- နမွဲၦၥီၪ့ထဲၩ့ ၦလၧအလ ၥ့ၪယၫဘၪဆၧလဖၪ, နမွဲၦဖိၪၥၪၥံၪအဆရၫ, နမွဲၦအီၪ လၧဆၧၥ့ၪယၫအခံးအဂၩ့ဒဲဆၧမွဲဆၧတီၩ လၧဆၧ",
			"21": "<sup>21</sup> မၪလူၬအဖၧၩ့တၭ,- ၦလၧအၥီၪ့ထဲၩ့ ၦဂူၫဂၩလဂၩ ဧ့,မွဲနလၥီၪ့လၩ့နၥၭဒၪနဝ့ၫဧၪ. ၦလၧအစံၭထီးအၪ့",
			"22": "<sup>22</sup> ဂူၪဆၧလဂ့ၩ, လဂၩဧ့, မွဲနအၪ့ဂူၪဆၧဆ့ဧၪ.- ၦလၧ အစံၭ ထီးမၩမၪၦမၫၦဝၩလဂ့ၩ, လဂၩဧ့, မွဲနမၩမၪ ၦမၫၦဝၩဆ့ဧၪ. ၦလၧအၥၭဂဲၫ့ ဆၧဂၩ့ဆၧဖၪ့, လဂၩ ဧ့, ဆၧမၩဘိၪ့အယွၩ အဆၧလဖၪနီၪ, မွဲနအၪ့ဂူၪဆ့",
			"23": "<sup>23</sup> ဧၪ.- ၦလၧအအီၪက့ၪဖိၫလိၫထၪ့အၥၭလၧဆၧမၪလူၬ အဖၧၩ့, နၧၩလဂၩဧ့, မွဲနမၩဂၭဂီၩ့ယွၩအလၩအဖၩ့ လၧနလၨၪခၫ့ဖၬ ဆၧမၪလူၬနီၪဆ့ဧၪ.",
			"24": "<sup>24</sup> အ ဂဲး ဘဲၫ ယီၩ ယွၩ အ မံၩ့ ဘၪ ဆၧ ဒုၪ ဒွ့ၪ လၧ ၦ ဆၨၩ လ ဖၪ အ ကျၩ လၧ န ၥံၪ အ ကၠီၩ့,",
			"25": "<sup>25</sup> ဘဲၫဆၧကွ့ၭအၥၭ အၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ နအ့ၪထီးန့ဖံၭထၬ ဆၧမၪလူၬတၭ, ဆၧကူၭတရံၭအီၪ လၧအခိးအတၩ တၡါဆ့လီၫ. မွဲလါနၫ့နအ့ၪလၨၪခၫ့ ဖၬဆၧမၪလူၬတၭ, နဆၧကူၭတရံၭနီၪ ကဲၪထဲၩ့ဝ့ၫလၧ",
			"26": "<sup>26</sup> ဆၧလကူၭတရံၭဘၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦ လၧအလဒိၭဘၪ ဆၧကူၭတရံၭနီၪ, အ့ၪထီးန့ဖံၭထၬ ဆၧမၪလူၬ ဘဲၫဆၧကွ့ၭအၥၭအၥိၭနီၪ, ဆၧမိအီၪ က့ၪထၪ့အဆၧ လကူၭတရံၭဘၪနီၪ လၧဆၧကူၭတရံၭ",
			"27": "<sup>27</sup> အလးမွဲအ့ၬဧၪ.- ၦလၧအလဒိၭဘၪ ဆၧကူၭတရံၭဘဲၫ အထူၫအရူၫ အီၪဝ့ၫအၥိၭနီၪ, အ့ၪထီးန့ဆၧမၪလူၬနီၪ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩတၭ, မွဲအမိစ့ၩရၫ့ၦလၧအအီၪ လၧလံၬၥံၪလဲၥံၪ, ဒဲဆၧကူၭတရံၭ, ဒဲအလၨၪခၫ့ဖၬဆၧ မၪလူၬ, နဝ့ၫဒၪလဂၩယီၩ မွဲအ့ၬဧၪ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩ ၦယုဒၫဖိၪလမွဲဘၪၦအအီၪဖျီၪဝ့ၫလၧ ခီၫ့နီၪ, ဒဲဆၧကူၭတရံၭမွဲဆၧဖျီၪလၧဆၧဖံၭဆၧယၪ",
			"29": "<sup>29</sup> အဖၧၩ့ဆ့အ့ၬ.- အ့ၪမွဲၦယုဒၫဖိၪမွဲ ၦလၧယၫလခီၫနီၪ, ဒဲဆၧကူၭတရံၭဘၪဆဲၫ့လၧၦၥၭတၭ, လမွဲဘၪလၧ လံၬအဖျိၪ့, မွဲလၧၥၭနီၪလီၫ. အဆၧစံၭထၪ့အၪ့အူၭ ဝ့ၫနီၪ,လမွဲဘၪလၧၦၡၩ, မွဲလၧယွၩလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪအဆၧအၪနဲၪ့နီၪ, မွဲ ဆၧနီၪလမံၩ့လဲၪ. ဒဲဆၧကူၭတရံၭနီၪ အခိးအတၩမွဲ",
			"2": "<sup>2</sup> ဆၧနီၪလမံၩ့လဲၪ.- အီၪဘဲၫအံၩ ဘဲၫအိၩ အၪမံၩ့လီၫ. လၧအဒိၪထုၬလမံၩ့, မွဲဆၧဖ့ၪလၫ့အဝ့ၫၥံၪ လၧယွၩအ လူအထၫနီၪလီၫ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ ၦလနၩ့နၩ့လနဲၩဘၪနီၪ, ဆၧမိမၩ အၥၭဘဲၫၥ့ၪလဲၪ. ၦၡၩၥံၪအဆၧလနဲၩဘၪနီၪ မွဲအမိ",
			"4": "<sup>4</sup> မၩဂၭဂီၩ့ယွၩ အလူတီၩဆ့ဧၪ.- မွဲလၩလါအ့ၬ, ကယဲ ၦၡၩမွဲၦချဲၩ့ဘျံၭချဲၩ့ဘျၪ ဆၧကိၭဂၩဒ့ၭ လါနၫ့ဘိၩ, မွဲယွၩအလူတီၩဒၪဝ့ၫဆံၭ. ဘဲၫဆၧကွ့ၭအၥၭအၥိၭ နီၪ, ဘဲၫၥိၭနမိဘၪဆၧအီၪက့ၪတီၩ အီၪက့ၪလီၩ့နၧၩ လၧနဆၧချဲၩ့တၭ, ထီးနအ့ၪဘၪဆၧစ့ၩရၫ့နီၪ, နမိမၩနၧၩ့မၩစၪဆၧ လီၫ.",
			"5": "<sup>5</sup> ပဆၧလတီၩလလီၩ့ဘၪနီၪ, အ့ၪနဲၪဖျီၪထၪ့ယွၩအ ဆၧတီၩဆၧလီၩ့တၭ, မွဲပမိစံၭဆၧနီၪလဲၪ. ယွၩလၧအ မၩၡၪ့ဆၧနီၪ, မွဲအမၩဝ့ၫ လတီၩလလီၩ့ဘၪဆ့ဧၪ.",
			"6": "<sup>6</sup> (ယချဲၩ့ဆၧဘဲၫၦၡၩအၥိၭ) မွဲလၩလါအ့ၬ. ဆၧအ့ၪ မၩအၥၭဘဲၫနီၪတၭ, ယွၩမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪဘဲၫၥ့ၪ",
			"7": "<sup>7</sup> လဲၪ.- အဂဲးဘဲၫယီၩ လၧယဆၧချဲၩ့ဘျံၭ ချဲၩ့ဘျၪအ ကၠီၩ့နီၪ, ယွၩအဆၧမွဲဆၧတီၩ အ့ၪဖျီၪထၪ့လၧအလၩ အဖၩ့အဂဲး အၪနဲၪ့အလးဒံၭနီၪ, ဆၧစ့ၩရၫ့ဒံၭယၧၩ ဘဲၫၦဆၧဒဲၩဘၭဖိၪ အၥိၭနီၪမွဲဘၪလဲၪ.",
			"8": "<sup>8</sup> ဘဲၫပဘၪဆၧဒုၪဒွ့ၪတၭ, ၦလနၩ့နၩ့စံၭဝ့ၫ, လၧပစံၭ ဆၧယီၩ, ဘဲၫဆၧဂ့ၩမိအီၪထၪ့အၥိၭ, မွဲပမၩၡီၩ့ဆၧ အၧၩ့ဘီၪ. အဝ့ၫၥံၪဘၪဆၧစ့ၩရၫ့စၪမွဲအတီၩအလီၩ့ လီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲဆၧနီၪလဲၪ,ပဝ့ၫဒၪယီၩမွဲပ ဂ့ၩဒၪဆၧလမံၩ့မံၩ့ဆ့ဧၪ.မွဲနးဆံၭအ့ၬ. အဂဲးဘဲၫယီၩ ၦယုဒၫဖိၪၥံၪမွဲဂ့ၩ, ၦဂံစၭဖိၪၥံၪမွဲဂ့ၩ, ပဒုၭနဲၪဝဲၩ",
			"10": "<sup>10</sup> ယူၭလၧဆၧဒဲၩဘၭဘၪအဝ့ၫၥံၪကိၭဂၩဒ့ၭယူၭ.- ဘဲၫ ဆၧကွ့ၭ အၥၭ အၥိၭနီၪ, ၦ တီၩ ၦ လီၩ့ လ အီၪ",
			"11": "<sup>11</sup> ဘၪ နး ဂၩ, န့ၫ လ ဂၩ နီၪ အီၪ အ့ၬ.- ၦ လၧ အ ၥၭ ဖၭ အီၪ အ့ၬ, ၦ လၧ အ အၪ့ ဎၬ ယွၩ",
			"12": "<sup>12</sup> အီၪ နး ဂၩ အ့ၬ,- ၦ ဂၭ ဖျိၭ ဖၧၩ့ ၥၭ ကိၭ ဂၩ ဒ့ၭ ကဲၪ ထၪ့ ၦ လ န့ ကၩ ဘၪ ဆၧ စီၪ့ ဎး, ၦ မၩ ဆၧ ဂ့ၩ လ အီၪ ဘၪ, န့ၫ လ ဂၩ နီၪ အီၪ",
			"13": "<sup>13</sup> အ့ၬ.- အ ခိၬ ယု ဖၧၩ့ မွဲ ဆၧ ၥွၪ ခိၪ အ ဖၧၩ့ အီၪ ဝဲ ထၪ့ အ ၥၭ, မွဲ အ အၪ့ လီၫ ဆၧ လၧ အ ဖျ့ၩ, ဂူ အၧၩ့ အ စုၪ အီၪ လၧ အ နိၭ ဖံၭ လၬ,",
			"14": "<sup>14</sup> အ နိၭ ဖၧၩ့ ဎွ့ၩ ဝ့ၫ လၧ ဆၧ ဆိၪ အၧၩ့, ဒဲ ဆၧ",
			"15": "<sup>15</sup> ခၪ လီၫ.- အ ခၪ့ ဖျဲၪ ဘဲၫ ၥိၭ အ မိ လူၫ လၩ့",
			"16": "<sup>16</sup> ဆၧ အ ၥွံၪ,- ဆၧ ဂၭ ဂီၩ့ ဂၭ စၪ, ဒဲ ဆၧ ၡၪ့",
			"17": "<sup>17</sup> ဆၧ နၭ အီၪ လၧ အ ဖၧၩ့ ၥၭ,- ဒဲ ဆၧ ဘၪ လိၬ အိၭ လိၬ အ ဖၧၩ့ ၥၭ, အ ဝ့ၫ ၥံၪ ၥ့ၪ ယၫ ဝ့ၫ",
			"18": "<sup>18</sup> အ့ၬ.- ဆၧ ၥၭ မဲၪ ယွၩ အီၪ လၧ အ ဝ့ၫ ၥံၪ အ မ့ၬ ယၫ နး ဆံၭ အ့ၬ.",
			"19": "<sup>19</sup> တၭပၥ့ၪယၫ လၧထီးဒၪဆၧမၪလူၬ စံၭဝ့ၫနီၪ, မွဲအ လီၩဘၪၦလၧအအီၪ လၧဆၧမၪလူၬအဖၫ့လၬနီၪ, ဘဲၫ ၥိၭကယဲၦၡၩအနိၭမိဘၪဆၧမၩဘံၭထၬဝ့ၫ, ဒဲဂၪ့ ခိၪမိဘၪဆၧစ့ၩရၫ့စၪ လၧယွၩအမ့ၬယၫ ထီးအလူၬ",
			"20": "<sup>20</sup> လီၫ.- အဂဲးဘဲၫယီၩ လၧဆၧမၪလူၬ အဆၧမၩအ ကၠီၩ့,ဆၧဖံၭဆၧယၪ ဘၪဆၧအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ လၧအမ့ၬယၫ နးဂၩအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧၥ့ၪယၫ ဆၧဒဲၩဘၭ လၧဆၧမၪလူၬအကၠီၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ယွၩအဆၧတီၩဆၧလီၩ့လၧအ လအီၪဘၪ လၧဆၧမၪလူၬနီၪအီၪဖျီၪဝ့ၫတၭ, မွဲဆၧမၪ",
			"22": "<sup>22</sup> လူၬ ဒဲမီၪၥံၪထိးအၥၭလၧအဂဲး,- ဘဲၫပစံၭဆၧအ ၥိၭ,ယွၩအဆၧတီၩဆၧလီၩ့ အီၪလၧၦနဲၩ ယ့ၫရှူၬဎရံၬ ထီးအလူၬအဂး,ဒဲဘၪၦနဲၩထဲၩ့ဆၧထီးအလူၬဆ့",
			"23": "<sup>23</sup> တၭ,မွဲအဆၧလၩ့မဲၩအီၪအ့ၬ.- အဂဲးဘဲၫယီၩ ၦထီး အလူၬ မၩဒဲၩဘၭဆၧတၭ, န့ဘၪယွၩအလၩအဖၩ့",
			"24": "<sup>24</sup> အ့ၬ.- မွဲလၧယ့ၫရှူၬဎရံၬဎွ့ၩန့ထဲၩ့ဆၧအကၠီၩ့တၭ, ပ ဘၪဆၧအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ပၧၩ ပျီၩပျီၩလၧယွၩ",
			"25": "<sup>25</sup> အခိးအတၩလီၫ.- ယွၩအီၪက့ၪလၩ့ အဝ့ၫဒၪလၧဆၧ ဖီၩ့ဖျ့ၭအလး လၧဆၧနဲၩလၧဆၧၥွံၪအကၠီၩ့, ဘဲၫၥိၭ အမိဒုၭနဲၪအဆၧတီၩဆၧလီၩ့ လၧအမၩဖီၩ့ဖျ့ၭဆၧ ဒဲၩဘၭ,လၧၦမၩဝဲၩဝ့ၫ လၧယွၩအဆၧအွံၪၥၭဆၧၩ့",
			"26": "<sup>26</sup> အဘိၩ့ဘၭ,- ဘဲၫၥိၭအမိဒုၭနဲၪ အဆၧတီၩဆၧလီၩ့ အထီထီးယီၩ,ဘဲၫၥိၭအဝ့ၫဒၪမိအီၪတီၩအီၪလီၩ့, ဒဲအီၪက့ၪတီၩအီၪက့ၪလီၩ့ ၦလၧအနဲၩ ယ့ၫရှူၬဎရံၬ လီၫ.",
			"27": "<sup>27</sup> မၩအၥၭဘဲၫနီၪတၭ, ပအီၪက့ၪဖိၫလိၫပၥၭနီၪ အ လးအီၪခီၫခီၫလဲၪ. ဘၪဆၧနၫ့ထၪ့ခွံၬယူၭ, လၧဆၧ နီၫလၫ အထူၫအရူၫလမံၩ့လဲၪ. မွဲလၧဆၧမၩအကၠီၩ့ နီၪဆ့ဧၪ. မွဲအ့ၬ, မွဲလၧဆၧနဲၩအထူၫအရူၫ အကၠီၩ့နီၪ",
			"28": "<sup>28</sup> လီၫ.- အဂဲးဘဲၫယီၩ ပစံၭလၧဆၧမၩ အထူၫအရူၫလ အီၪဘၪနီၪ, ၦၡၩဘၪဆၧအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ဝ့ၫ လၧဆၧနဲၩလီၫ.",
			"29": "<sup>29</sup> အဝ့ၫနီၪ, မွဲန့ၫၦယုဒၫဖိၪအယွၩနီၪဆ့ဧၪ.မွဲလမွဲဘၪ ၦဆၨၩလဖၪအယွၩနီၪဆ့ဧၪ. မွဲယူၭ, မွဲလၧၦဆၨၩလ",
			"30": "<sup>30</sup> ဖၪအဂးဆ့လီၫ.- အဂဲးဘဲၫယီၩ ၦလၧအမိအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ ၦဒိၭဆၧကူၭတရံၭ လၧဆၧနဲၩအကၠီၩ့နီၪ ဒဲၦလဒိၭဘၪဆၧကူၭတရံၭ လၧဆၧနဲၩအကၠီၩ့နီၪ, မွဲ",
			"31": "<sup>31</sup> ယွၩလဂၩဎးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,မွဲပမၩဂၭ ဂီၩ့ဆၧမၪလူၬ လၧဆၧနဲၩအကၠီၩ့နီၪဆ့ဧၪ. မွဲလၩ လါအ့ၬ,မွဲမၬ, ပမၩဂုးမၩခၧၫ့ထၪ့ဆၧမၪလူၬနီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲပမိစံၭ, လၧပဖါစအၫဘြဟၫ့ န့ဘၪယူၭ ဆၧနီၫလၫဘၪဆဲၫ့လၧဆၧဖံၭဆၧယၪနီၪ လမံၩ့လဲၪ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩ စအၫဘြဟၫ့ အ့ၪဘၪဆၧတီၩ ဆၧ လီၩ့လၧအမၩဆၧအကၠီၩ့နီၪ, မွဲအအီၪက့ၪဖိၫလိၫအ ၥၭအလးအီၪဝ့ၫလီၫ. မွဲလါနၫ့ဘိၩ လၧယွၩအမ့ၬ",
			"3": "<sup>3</sup> ယၫမွဲအ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအၥၭ စံၭဝ့ၫဘဲၫ ၥ့ၪ လဲၪ, စ အၫ ဘြ ဟၫ့ နဲၩ ယွၩ တၭ, ဆၧ အီၪ က့ၪ အ ဆၧ နဲၩ နီၪ လၧ ဆၧ တီၩ ဆၧ လီၩ့ လၧ",
			"4": "<sup>4</sup> အ ဂး လီၫ.- တၭလၧၦမၩဆၧအဂးနီၪ, အဆၧအီၪ က့ၪအလံၩ့အလဲၫလမွဲဘၪဘဲၫဆၧအခိးအတၩအ",
			"5": "<sup>5</sup> ၥိၭ, မွဲဘဲၫအဒ့ၪအမါအၥိၭလီၫ.- အ့ၪမွဲၦလၧအလ မၩဘၪဆၧနီၪ, မွဲအနဲၩၦလၧ အအီၪက့ၪတီၩအီၪက့ၪ လီၩ့ၦအၧၩ့ဖိၪနီၪ, ဆၧအီၪက့ၪအဆၧနဲၩ လၧဆၧတီၩ",
			"6": "<sup>6</sup> ဆၧလီၩ့အဂးလီၫ.- ဘဲၫနီၪအၥိၭၦလၧအလမၩဘၪ ဆၧဆ့, ယွၩအီၪက့ၪတီၩအီၪက့ၪလီၩ့အဝ့ၫနီၪ,စဒၫဝံၭ",
			"7": "<sup>7</sup> လီၩဘၪအဆၧဆိၪဂ့ၩ အဂဲးအကၠီၪ့ဆ့တၭ,စံၭဝ့ၫဒၪ, ၦလၧအဆၧမၪၥံၪဖျါယူၭနီၪ, ဒဲအဆၧဒဲၩဘၭဘၪဆၧမၩဘံၭဝ့ၫလဖၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ၦၡၩလၧယွၩလအီၪက့ၪဘၪဆၧမၪ လၧအလီၩ့နီၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧဆိၪဂ့ၩယီၩ မွဲအဘၪန့ၫၦ လၧအဒိၭ ဆၧကူၭတရံၭနီၪဧၪ. မွဲအဘၪ ၦလၧအလ ဒိၭဘၪ ဆၧကူၭတရံၭနီၪဆ့ဧၪ. အဂဲးဘဲၫယီၩ ပစံၭ လၧဆၧအီၪက့ၪဆၧနဲၩ လၧဆၧတီၩဆၧလီၩ့ လၧစအၫ ဘြဟၫ့အဂးလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪက့ၪဝ့ၫဘဲၫၥ့ၪလဲၪ, လၧအအီၪဝ့ၫ လၧဆၧကူၭတရံၭအဖၧၩ့နီၪ, မွဲလၧအလ အီၪဘၪ လၧဆၧကူၭတရံၭ အဖၧၩ့လဲၪ. လၧဆၧကူၭ တရံၭအဖၧၩ့နီၪ လမွဲဘၪ, မွဲလၧအလအီၪဒံၭဘၪ လၧ",
			"11": "<sup>11</sup> ဆၧကူၭတရံၭအဖၧၩ့လီၫ.- အဝ့ၫဒၪဒိၭန့ဘၪဆၧကူၭ တရံၭအဆၧမၩနဲၪ့,ဆၧတီၩဆၧလီၩအဆၧစဲၩနဲၪ့ ဘၪဆဲၫ့လၧဆၧနဲၩ လၧအအီၪဝ့ၫလၧအလချႃၭဒိၭဒံၭ ဘၪဆၧကူၭတရံၭ, ဘဲၫၥိၭအမိကဲၪထၪ့ကယဲၦနဲၩဆၧ, လၧအလဒိၭဘၪလါနၫ့ဆၧကူၭတရံၭထီးအလူၬအ ဖါ,ဘဲၫၥိၭအမိအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ အဝ့ၫၥံၪဆ့,",
			"12": "<sup>12</sup> ဒဲၦဒိၭဆၧကူၭတရံၭအဖါ န့ၫၦဒိၭဆၧကူၭတရံၭနီၪ လကၭလၧၩ့ အ့ၪမွဲၦလၧအယဲးလၩ့ပဖါစအၫဘြဟၫ့ အဆၧနဲၩအခၪ့လးဆ့, လၧအအီၪဝ့ၫလၧအလချႃၭ ဒိၭဒံၭဘၪ ဆၧကူၭတရံၭနီၪလီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩစအၫဘြဟၫ့မွဲဂ့ၩ, အချံၫအၥၪမွဲဂ့ၩ, ဆၧစံၭဝဲၩဝ့ၫ လၧအမိန့ဘၪထဲၩ့ၥၫဂၪ့ခိၪ လၧဆၧမၪ လူၬအဂးလမွဲဘၪ, မွဲလၧဆၧတီၩဆၧလီၩ့ဘၪဆဲၫ့",
			"14": "<sup>14</sup> လၧဆၧနဲၩအဂးလီၫ.- အဂဲးဘဲၫယီၩၦဘၪဆဲၫ့လၧဆၧ မၪလူၬအ့ၪန့ထဲၩ့ၥၫဆၧတၭ, ဆၧနဲၩကဲၪထၪ့ဝ့ၫ လၧဆၧပျီၩပျီၩတၭ, ဆၧချဲၩ့ဝဲၩဆၧနီၪကဲၪထၪ့ထဲၩ့",
			"15": "<sup>15</sup> ဝ့ၫလၧဆၧန့ကၩနးမံၩ့အ့ၬ.- အဂဲးဘဲၫယီၩဆၧမၪ လူၬနီၪဒုၭအီၪထၪ့ဆၧၥၭထၪ့လီၫ. အဂဲးဘဲၫယီၩ ထီးဒၪဆၧမၪလူၬ လအီၪဘၪနီၪမွဲဆၧအမၪအီၪ",
			"16": "<sup>16</sup> အ့ၬ.- မွဲဘဲၫနီၪတၭဘၪဆဲၫ့ဝ့ၫလၧဆၧနဲၩဘဲၫၥိၭအမိ ဘၪဆဲၫ့လၧဆၧအခိးအတၩ, ဘဲၫၥိၭဆၧစံၭဝဲၩဆၧမိ အီၪဂုးအီၪခၧၫ့ လၧအချံၫအၥၪထီးအလူၬ, န့ၫၦဘၪ ဆဲၫ့လၧဆၧမၪလူၬနီၪလကၭလၧၩ့, အ့ၪမွဲၦလၧအဘၪ ဆဲၫ့လၧစအၫဘြဟၫ့အဆၧနဲၩဆ့, အဝ့ၫဒၪနီၪမွဲပဝ့ၫ",
			"17": "<sup>17</sup> ထီးအလူၬအဖါ,-(ဘဲၫဆၧကွ့ၭအၥၭအၥိၭ, ယအီၪ က့ၪယူၭနၧၩလၧၦအၪဆၨၩအဖါယူၭ.)- လၧယွၩလၧ အနဲၩဝ့ၫအမ့ၬယၫ, လၧအမၩမၧၫ့ထၪ့ထဲၩ့ၦၥံၫ, ဒဲအကိၭဆၧလၧအလအီၪဘၪ, ဘဲၫအအီၪဝ့ၫအၥိၭ နီၪလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪနီၪ ဆၧယိလါအလးလအီၪဘၪတၭ, နဲၩ လၧဆၧယိလါအဖၧၩ့ဘဲၫၥိၭအမိကဲၪထၪ့ၦအၪဆၨၩ အဖါ,ဘဲၫဆၧကွ့ၭအၥၭအၥိၭ, နချံၫနၥၪမိကဲၪထၪ့ဘဲၫ",
			"19": "<sup>19</sup> နီၪအၥိၭလီၫ.- အဆၧနဲၩဆါလမွဲဘၪ,အၥၭမၧၫ့ဝ့ၫ ဘူၭကၪအနံၪ့လယၩတၭ, အနၫ့ဆါၥံၫဝ့ၫမွဲဂ့ၩ,နးစၫ ရၫအဒၧၩ့လး ၥံၫဝ့ၫမွဲဂ့ၩ,လဆီၫ့မီၪ့ဘၪဝ့ၫလီၫ.",
			"20": "<sup>20</sup> လၧဆၧလနဲၩဘၪယွၩအဆၧစံၭဝဲၩဝ့ၫ အဂဲးနီၪအၥၭ ဂံၩ့ဂၩ့အ့ၬ. အ့ၪမွဲအဆၧနဲၩအီၪဂုးအီၪခၧၫ့ဝ့ၫတၭ,",
			"21": "<sup>21</sup> အီၪက့ၪလၩဖၩ့ယွၩနီၪ,- ဒဲအနဲၩဆၧလၧၫ့လၧၫ့ဎွ့ၩ ဎွ့ၩ,လၧၦအလီၩဘၪဝဲၩဆၧလဂၩနီၪ, မၩဝ့ၫၥ့ၪဆ့",
			"22": "<sup>22</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪက့ၪအဆၧနဲၩလၧ ဆၧတီၩဆၧလီၩ့အဂးလီၫ.",
			"23": "<sup>23</sup> ဆၧကွ့ၭဝဲၩဝ့ၫန့ၫအဝ့ၫနီၪအကၠီၩ့ လၧအဘၪအီၪက့ၪ",
			"24": "<sup>24</sup> ဝ့ၫအဂးလမွဲဘၪ,- အ့ၪမွဲၦလၧအနဲၩထဲၩ့ၦလၧအ ဒုၭဂဲထုၪ့ထဲၩ့ ပကဆါယ့ၫရှူၬ လၧဆၧၥံၫအဖၧၩ့လဖၪ အဂး, ပဝ့ၫဒၪယီၩဆ့,ဆၧမိအီၪက့ၪဝ့ၫလၧပဂးလီၫ.",
			"25": "<sup>25</sup> ပကဆါနီၪ ဘၪဆၧဖ့ၪလၫ့ခွံၬလၧပဆၧမၪအကၠီၩ့ တၭ,ဆၧဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫ လၧပဆၧတီၩဆၧလီၩ့အဂးလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ,ဆၧအီၪက့ၪတီၩအီၪက့ၪလီၩ့ ပၧၩလၧဆၧနဲၩအဂဲးနီၪ, ပန့ဆၧဘၪလိၬထဲၩ့ပၥၭ လၧ",
			"2": "<sup>2</sup> ယွၩလၧပကဆါယ့ၫရှူၬဎရံၬ အကၠီၩ့လီၫ.- လၧအဝ့ၫ ဒၪနီၪအကၠီၩ့ဆ့, လၧဆၧနဲၩအဂဲးတၭ, ပလ့ၩနုၬဘၪ လၧဆၧအခိးအတၩ လၧပဆၧၫ့ထုၪ့ လၧအဖၧၩ့ယီၩပ ၥုၪ့ဎွံၫၥၭယီၫလၧဆၧယိလါယွၩ အလၩအဖၩ့အဖၧၩ့",
			"3": "<sup>3</sup> လီၫ.- န့ၫနီၪလကၭလၧၩ့, အ့ၪမွဲၦၥုၪ့ဎွံၫၥၭယီၫ လၧဆၧ နၭဆၧၡၪ့အဖၧၩ့ဆ့တၭ, မွဲပၥ့ၪယၫလၧဆၧနၭဆၧ",
			"4": "<sup>4</sup> ၡၪ့မၩအီၪထၪ့ ဆၧအွံၪၥၭဆၧၩ့လီၫ.- ဆၧအွံၪၥၭဆၧၩ့ နီၪမၩအီၪထၪ့ဆၧဂုးဆၧခၧၫ့, ဆၧဂုးဆၧခၧၫ့နီၪ မၩ",
			"5": "<sup>5</sup> အီၪထၪ့ဆၧယိလါ,- ဆၧယိလါနီၪလမၩမဲဘၪဆၧ အမ့ၬနီၪ, အဂဲးဘဲၫယီၩ ၥၭမုဆံၫ့ဎံၪ လၧဆၧဖ့ၪလၫ့ ဝ့ၫလၧပဂးနီၪ, လူၫလၩ့ယွၩအဆၧအဲၪဆၧကွံၩလၧ ပၥၭခံဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩလၧပဂဲးဆါပဘၭဆါနီၪ, အမုအလၩ ဘၪဝ့ၫတၭ, ဎရံၬထိးၥံၫအၥၭ လၧၦလၧအလယူၭလ",
			"7": "<sup>7</sup> ယၪ့ဘၪယွၩအဂးလီၫ.- အဂဲးဘဲၫယီၩ ၦၡၩလဂၩဂၩ မိထိးၥံၫအၥၭ လၧၦတီၩၦလီၩ့အဂးနီၪ, မွဲဆၧကၪမၬ လီၫ. မွဲလါနၫ့ဘိၩ, လၧၦဂ့ၩအဂးနီၪ, ၦထိးၥံၫအၥၭ",
			"8": "<sup>8</sup> ဘုၪ့ဘၪလဘၪ မိအီၪဝ့ၫလဂၩဂၩလီၫ.- အ့ၪမွဲယွၩနဲၪ ဖျီၪထၪ့အဆၧအဲၪဆၧကွံၩ လၧပဂးဘိၩ့ယီၩ, ထီးပမွဲ ဆၧဒဲၩဘၭဖိၪ အဘိၩ့ဘၭနီၪ, ဎရံၬထိးၥံၫအၥၭလၧပ",
			"9": "<sup>9</sup> ဂးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘိၫ့နဲၪ့ယီၩ ဆၧအီၪက့ၪ တီၩအီၪက့ၪလီၩ့ပၧၩ လၧအၥွံၪအကၠီၩ့တၭ, ဆၧမိထိး ထဲၩ့တၩ့ထဲၩ့ မၩဖီၩ့မၩဖျ့ၭပၧၩလၧဆၧၥၭထၪ့နီၪ",
			"10": "<sup>10</sup> လၧအဝ့ၫဒၪအကၠီၩ့ အၪနဲၪ့အနီၪဒံၭလီၫ.- အဂဲးဘဲၫ ယီၩထီးပမွဲအဒုၪအဒၩ အဘိၩ့ဘၭနီၪ အ့ၪန့ဆၧဘၪ လိၬထဲၩ့ပၥၭ လၧယွၩအဖိၪခွၫ ၥံၫဝ့ၫအကၠီၩ့တၭ, ပန့ဘၪဆၧဘၪလိၬထဲၩ့ပၥၭဂီၩ့နီၪ, ပမိန့ဘၪဆၧထိး ထဲၩ့တၩ့ထဲၩ့ပၧၩ လၧအမၧၫ့ဝ့ၫအကၠီၩ့အၪနဲၪ့အ နီၪဒံၭလီၫ.",
			"11": "<sup>11</sup> န့ၫနီၪလကၭလၧၩ့, မွဲပၥုၪ့ဎွံၫၥၭယီၫလၧယွၩအ ဖၧၩ့လၧပကဆါ ယ့ၫရှူၬဎရံၬအကၠီၩ့ လၧပန့ဘၪဆၧ ဘၪလိၬထဲၩ့လၧအဝ့ၫနီၪ အကၠီၩ့ဘိၩ့နဲၪ့ယီၩလီၫ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫဆၧဒဲၩဘၭဂဲၫထၪ့လၧဂၪ့ ခိၪချိၫ့ယီၩ လၧၦလဂၩအကၠီၩ့ဒဲဆၧၥံၫဆၧၡါလၧ ဆၧဒဲၩဘၭအကၠီၩ့အၥိၭနီၪ ၦထီးအလူၬ မၩယူၭဆၧ ဒဲၩဘၭတၭ, မွဲအဘၪဆၧၥံၫဆၧၡါဘဲၫနီၪၥိၭ ကိၭဂၩ ဒ့ၭဆ့လီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩ ဆၧဒဲၩဘၭအီၪလၧဂၪ့ခိၪချိၫ့ယီၩ လၧ ဆၧမၪလူၬလချႃၭအီၪထၪ့ဒံၭဘၪလီၫ. အ့ၪမွဲဆၧမၪ လူၬအ့ၪလအီၪဘၪနီၪ, မွဲဆၧအီၪက့ၪဆၧဒဲၩဘၭ",
			"14": "<sup>14</sup> လၧအလီၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩ လၧစအၫဒၫ့အဆိၩထီၩ့ လၩ့လၧစမိစ့ၭအဆိၩနီၪ, ၦလၧအလမၩဘၪ ဆၧဒဲၩ ဘၭဘဲၫစအၫဒၫ့ အဆၧမၪအၥိၭဒၪလ့ၬနီၪ ဆၧၥံၫကဲၪ ဒိၪလၧအဖၫ့ခိၪလီၫ. စအၫဒၫ့နီၪမွဲ ၦလၧအမိဂဲၫလ",
			"15": "<sup>15</sup> ဂၩအဒီၩ့အထ့ၬလီၫ.- အ့ၪမွဲဆၧအခိးအတၩနီၪ, မွဲ ဘဲၫဆၧအမၪအၥိၭနီၪအ့ၬး အဂဲးဘဲၫယီၩ ၦအၪဂၩအ့ၪ ၥံၫလၧၦလဂၩ အဆၧမၪအကၠီၩ့တၭ, ယွၩအခိးအတၩ ဒဲအဆၧဖ့ၪလၫ့ လၧအဘၪဆဲၫ့ဆၧအခိးအတၩ, လၧ ၦလဂၩယ့ၫရှူၬဎရံၬနီၪ အၪထၪ့ဝ့ၫလၧၦအၪဂၩအဂး",
			"16": "<sup>16</sup> အၪနဲၪ့အနီၪဒံၭလီၫ.- ဆၧဖ့ၪလၫ့နီၪ မီၪ့ဎီၩ့ၦလၧအ မၩမၪဆၧအၥိၭနီၪအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧစ့ၩရၫ့နီၪ ဘၪဆဲၫ့လၧဆၧမၪလမံၩ့ လၧဆၧစ့ၩရၫ့စၪ အဂဲးလီၫ. အ့ၪမွဲဆၧဖ့ၪလၫ့ပျီၩနီၪဘၪဆဲၫ့ လၧဆၧမၪအၪမံၩ့လၧ",
			"17": "<sup>17</sup> ဆၧတီၩဆၧလီၩ့အဂဲးလီၫ.- အဂဲးဘဲၫယီၩ လၧၦ လဂၩအဆၧမၪအဂဲး, ဆၧၥံၫအ့ၪကဲၪဒိၪ လၧၦလဂၩ အကၠီၩ့တၭ, ၦလၧအန့ဘၪ ဆၧအခိးအတၩအၪနီၪ, ဒဲဆၧဖ့ၪလၫ့လၧအဘၪဆဲၫ့ ဆၧတီၩဆၧလီၩ့လဖၪ မိကဲၪဒိၪဝ့ၫ လၧဆၧမၧၫ့အဖၧၩ့ လၧၦလဂၩယ့ၫရှူၬ ဎရံၬအကၠီၩ့ အၪနဲၪ့အနီၪဒံၭလီၫ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၦကိၭဂၩဒ့ၭဘၪဆၧစ့ၩ ရၫ့စၪ လၧၦလဂၩအဆၧမၪ အကၠီၩ့အၥိၭနီၪ, ဘဲၫနီၪ ၥိၭဒၪလ့ၬ,ၦကိၭဂၩဒ့ၭ န့ဘၪဆၧတီၩဆၧလီၩ့ ဘၪဆဲၫ့ လၧဆၧမၧၫ့ လၧၦလဂၩအဆၧတီၩဆၧလီၩ့အကၠီၩ့",
			"19": "<sup>19</sup> အလးအီၪဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ ဘဲၫဆၧအီၪက့ၪ ၦအၪဂၩလၧဆၧဒဲၩဘၭဖိၪ လၧၦလဂၩလခိၭနၪဘၪ ဆၧအကၠီၩ့အၥိၭနီၪ, ဆၧမိအီၪက့ၪ ၦအၪဂၩလၧဆၧ တီၩဆၧလီၩ့ ဘဲၫၦလဂၩခိၭနၪဆၧ အၥိၭနီၪအကၠီၩ့ ဆ့လီၫ.",
			"20": "<sup>20</sup> ဆၧမၪလူၬအီၪထၪ့ ဘဲၫဆၧမၪမိအီၪထၪ့ဝ့ၫအၥိၭ လီၫ. မွဲလါနၫ့ဘိၩ ထီးဆၧဒဲၩဘၭ အၪထၪ့ဝ့ၫနီၪဆၧ",
			"21": "<sup>21</sup> အခိးအတၩ အၪထၪ့အၪနဲၪ့အနီၪဒံၭလီၫ.- ဘဲၫနီၪ ၥိၭဘဲၫဆၧဒဲၩဘၭ ကဲၪဒိၪလၧဆၧၥံၫ အဖၧၩ့အၥိၭနီၪ, ဆၧအခိးအတၩ မိကဲၪဒိၪလၧဆၧတီၩဆၧလီၩ့ အကၠီၩ့ လၧဆၧမၧၫ့အဆိၩအကၠၪအဂး လၧပကဆါယ့ၫရှူၬ ဎရံၬအကၠီၩ့လီၫ."
		},
		"6": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲပမိစံၭဆၧနီၪလဲၪ, မွဲပမိအီၪ ဂုးခၧၫ့ လၧဆၧဒဲၩဘၭအဖၧၩ့နီၪ, ဘဲၫၥိၭဆၧအခိး",
			"2": "<sup>2</sup> အတၩမိအၪထၪ့လခီၫဆ့ဧၪ.- မွဲလၩလါအ့ၬ. ပၥံၫဒၪ ခွံၬယူၭဆၧဒဲၩဘၭနီၪ, မွဲပမိမၧၫ့ဒံၭ လၧအဖၧၩ့ဘဲၫ",
			"3": "<sup>3</sup> ၥ့ၪလဲၪ.- ပဝ့ၫဒၪကယဲပဒိၭ ဘၭတံၫဇၫ့ယူၭပၥၭလၧ ယ့ၫရှူၬဎရံၬအဖၧၩ့လဖၪယီၩ, ပဒိၭဘၭတံၫဇၫ့ယူၭပ ၥၭလၧအဆၧၥံၫအဖၧၩ့ကိၭဂၩဒ့ၭနီၪ မွဲနၥံၪၥ့ၪယၫ",
			"4": "<sup>4</sup> အ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ပဘၪယူၭဆၧခုၪ့လၩ့ ဘၧၩ့ဎုၬလၧအဝ့ၫနီၪ, လၧဆၧဘၭတံၫဇၫ့ လၧအဆၧ ၥံၫအဖၧၩ့, ဘဲၫဎရံၬဂဲထုၪ့ထဲၩ့ လၧဆၧၥံၫအဖၧၩ့လၧ ဖါအလၩအဖၩ့အၥိၭနီၪ, ပဝ့ၫဒၪယီၩ ပမိလ့ၩဆၧလၧ",
			"5": "<sup>5</sup> ဆၧၥၭမၧၫ့အဖၧၩ့, ဘဲၫနီၪအၥိၭဆ့လီၫ.- အဂဲးဘဲၫ ယီၩပအ့ၪဘၪဆဲၫ့ လၧအဝ့ၫနီၪ လၧဆၧလၩ့ဂၬအဆၧ ၥံၫ, မွဲပမိဘၪဆဲၫ့လၧအဝ့ၫနီၪ အဆၧဂဲထုၪ့ထဲၩ့ဆ့လီၫ.",
			"6": "<sup>6</sup> ဆၧယီၩပၥ့ၪယၫ လၧပနၫ့ဆါလးလံၩဘၪဖျၩထၪ့ ဎုၬယူၭလၧအဝ့ၫနီၪ လၧထုၪ့စူၪယၫအလီၩ့, ဘဲၫဆၧ ဒဲၩဘၭအမိၡါ မိဂၭဂီၩ့အၥိၭတၭ,ဘဲၫပထီးကဲၪလၧၩ့",
			"7": "<sup>7</sup> ဆၧဒဲၩဘၭအဎီးအၡၩ လဂ့ၩအၥိၭနီၪလီၫ.- အဂဲးဘဲၫ ယီၩၦလၧအၥံၫနီၪ, ဖီၩ့ဖျ့ၭဝ့ၫ လၧဆၧဒဲၩဘၭလီၫ.",
			"8": "<sup>8</sup> ပအ့ၪၥံၫဎုၬလၧဎရံၬနီၪ, ပနဲၩလၧပမိမၧၫ့ဎုၬ လၧအဝ့ၫ",
			"9": "<sup>9</sup> နီၪဆ့လီၫ.- ပၥ့ၪယၫလၧဎရံၬ ဂဲထုၪ့ထဲၩ့ဝ့ၫလၧဆၧ ၥံၫအဖၧၩ့နီၪ, မွဲလမိၥံၫလၧၩ့ဘၪတၭ,ဆၧၥံၫနီၪလကဲၪ",
			"10": "<sup>10</sup> လၧၩ့ဘၪအကဆါလီၫ.- အဂဲးဘဲၫယီၩမွဲအၥံၫဝ့ၫနီၪ ၥံၫဝ့ၫလဖၧၫ့ လၧဆၧဒဲၩဘၭအကၠီၩ့ ဂီၩ့ယူၭလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲအမၧၫ့နီၪ, မွဲအမၧၫ့ဝ့ၫလၧယွၩအဂးလီၫ.- ဘဲၫ နီၪၥိၭအီၪက့ၪနၥံၪအၥၭ ဘဲၫနၥံၪၥံၫဒၪခွံၬ ဆၧဒဲၩဘၭ လၩ့ထံးလၩ့ဆ့ၭတၭ, အ့ၪမွဲမၧၫ့ဝ့ၫ လၧယ့ၫရှူၬ ဎရံၬအဖၧၩ့လၧယွၩအဂးဆံၭ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးဒုၭကဲၪဒိၪလၧၩ့ ဆၧဒဲၩ ဘၭလၧနၥံၪ အမိၡါလၧအၥံၫဝ့ၫ အဖၧၩ့ဘဲၫနၥံၪမိ",
			"13": "<sup>13</sup> ခိၭနၪအဆၧလဲးဆၧဘျၪအၥိၭနီၪလဂ့ၩ.- လၧနီၪအမ့ၬ ယၫ,ထီးအီၪက့ၪနၥံၪအဂၩ့လဖၪလၧဆၧလတီၩ လလီၩ့ဘၪအစူၪဝဲၩ လၧဆၧဒဲၩဘၭအဂးလဂ့ၩ. အ့ၪ မွဲအီၪက့ၪလၩ့ဒၪနၥံၪအၥၭဘဲၫၦမၧၫ့ထၪ့ထဲၩ့လၧ ဆၧၥံၫအဖၧၩ့အၥိၭနီၪ, လၧယွၩအဂး, ဒဲနၥံၪအဂၩ့ လဖၪ လၧဆၧတီၩဆၧလီၩ့ အစူၪဝဲၩ လၧယွၩအဂး",
			"14": "<sup>14</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧဒဲၩဘၭကဲၪလၧၩ့ နၥံၪအက ဆါအ့ၬ. မွဲနၥံၪလအီၪဘၪလၧဆၧမၪလူၬ အဖၫ့လၬ အဂဲးနီၪ, အ့ၪမွဲနၥံၪအီၪ လၧဆၧအခိးအတၩအဖၫ့ လၬလီၫ.",
			"15": "<sup>15</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲဆၧနီၪလဲၪ. မွဲပလအီၪဘၪ လၧဆၧမၪလူၬ အဖၫ့လၬအကၠီၩ့နီၪ, အ့ၪမွဲပအီၪလၧ ဆၧအခိးအတၩ အဖၫ့လၬ အကၠီၩ့တၭ, မွဲပမိမၩဒဲၩ",
			"16": "<sup>16</sup> ဘၭဆၧဆ့ဧၪ, မွဲလၩလါအ့ၬ.- မွဲနၥံၪလၥ့ၪယၫဘၪ လၧနၥံၪအီၪက့ၪလၩ့နၥံၪအၥၭ လၧဆၧအဎီးအၡၩလၧ နၥံၪမိခိၭနၪဆၧအဂဲးနီၪ, ဆၧဒဲၩဘၭဘၪဆဲၫ့လၧဆၧ ၥံၫမွဲဂ့ၩ, ဆၧခိၭနၪဘၪဆဲၫ့ လၧဆၧတီၩဆၧလီၩ့မွဲဂ့ၩ, ဆၧလၧနၥံၪခိၭနၪဝ့ၫနီၪ, မွဲနၥံၪကဲၪအဎီးအၡၩအ့ၬ",
			"17": "<sup>17</sup> ဧၪ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪမွဲယူၭဆၧဒဲၩဘၭအဎီး အၡၩလါနၫ့ဘိၩ, နၥံၪခိၭနၪလၧၥၭခံဖၧၩ့ ဆၧၥီၪ့ဆၧ ၥၫ့လမံၩ့လၧဆၧဖ့ၪလၫ့နၥံၪအကၠီၩ့နီၪ, မွဲယွၩဘၪ",
			"18": "<sup>18</sup> ဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဒၪဆံၭ.- တၭနၥံၪန့ဘၪယူၭဆၧ မၩဖီၩ့မၩဖျ့ၭလၧဆၧဒဲၩဘၭနီၪ,မွဲနၥံၪကဲၪထဲၩ့ဆၧ",
			"19": "<sup>19</sup> တီၩဆၧလီၩ့ အဎီးအၡၩၥံၪလီၫ,- မွဲနၥံၪအဂဲးဆါအ ဘၭဆါလၧနၥံၪ အဖံၭအယၪအကၠီၩ့တၭ, ယချဲၩ့ဆၧ ဘဲၫၦၡၩအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ ဘဲၫနၥံၪအီၪက့ၪ ဝဲၩနၥံၪအဂၩ့ လၧဆၧအဲၪလဲးအဲၪဘျၪ, ဒဲဆၧလတီၩ လလီၩ့ဘၪ အဎီးအၡၩၥံၪ, လၧဆၧလတီၩလလီၩ့ဘၪ အဂးအၥိၭနီၪး ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ အီၪက့ၪထဲၩ့နၥံၪ အဂၩ့ၥံၪလၧဆၧတီၩဆၧလီၩ့ အဎီးအၡၩၥံၪလၧဆၧ",
			"20": "<sup>20</sup> ဆံၫ့ဎံၪအဂးဘဲၫနီၪၥိၭဆံၭ.- အဂဲးဘဲၫယီၩ လၧနၥံၪမွဲ ဆၧဒဲၩဘၭအဎီးအၡၩၥံၪနီၪ, မွဲနၥံၪဖီၩ့ဖျ့ၭလၧဆၧ",
			"21": "<sup>21</sup> တီၩဆၧလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧလၧနၥံၪ မ့ၬမဲလၧအကၠီၩ့ ဘိၩ့နဲၪ့ယီၩ, လၧအထီနီၪ, မွဲနၥံၪန့ ဘၪဆၧနီၪအၥၪလမံၩ့လဲၪ.အဂဲးဘဲၫယီၩ ဆၧနီၪ လဖၪအထုၬမွဲ ဆၧၥံၫလီၫ.",
			"22": "<sup>22</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ နၥံၪဖီၩ့ဖျ့ၭ လၧဆၧဒဲၩဘၭနီၪ, နၥံၪကဲၪထဲၩ့ယွၩ အဎီးအၡၩၥံၪတၭ, နၥံၪအီၪလၧနၥံၪ အဆၧၥၪဘၪဆဲၫ့ လၧဆၧဆံၫ့ဎံၪတၭ, အထုၬနီၪမွဲဆၧ",
			"23": "<sup>23</sup> မၧၫ့အဆိၩအကၠၪလီၫ.- အဂဲးဘဲၫယီၩ ဆၧဒဲၩဘၭအ လံၩ့အလဲၫမွဲဆၧၥံၫလီၫ. အ့ၪမွဲယွၩအဆၧဖ့ၪလၫ့ နီၪမွဲဆၧမၧၫ့အဆိၩအကၠၪ လၧပကဆါယ့ၫရှူၬဎရံၬ အဖၧၩ့နီၪလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> ဖုၥံၪဝဲၥံၪဧ့, နၥံၪၥ့ၪယၫ (တၭယလီၩဘၪၦလၧအ ၥ့ၪယၫဆၧမၪလူၬ) လၧၦၡၩမၧၫ့ဝ့ၫ အဘိၩ့ဘၭ ဆၧ",
			"2": "<sup>2</sup> မၪလူၬပၧၩ့ဘၪဝ့ၫနီၪ, မွဲအ့ၬဧၪ.- အဂဲးဘဲၫယီၩ ၦမုၪ အီၪလၧအဝၩနီၪ, ထီးအဝၩမၧၫ့ဝ့ၫ အဘိၩ့ဘၭတၭ, ဘၪစၧၩ့ထၬဝ့ၫ လၧအဝၩ,လၧဆၧမၪလူၬ အကၠီၩ့ လီၫ.- မွဲလါနၫ့ဘိၩအဝၩအ့ၪၥံၫတၭ, မွဲအဖီၩ့ဖျ့ၭအ",
			"3": "<sup>3</sup> ဝၩအဆၧမၪလူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးအဝၩ မၧၫ့ဝ့ၫအဘိၩ့ဘၭနီၪ,အ့ၪအီၪဎုၬ လၧၦခွၫအဂူၫဂၩ တၭ, မိဘၪဆၧကိၭဝ့ၫ လၧၦအဲၪဘိၩ့အဝၩလီၫ. အ့ၪမွဲ အဝၩအ့ၪၥံၫ, မွဲအဖီၩ့ဖျ့ၭဆၧမၪလူၬနီၪ အ့ၪအီၪဎုၬ လၧၦခွၫအဂူၫဂၩလါနၫ့ဘိၩ အဲၪဘိၩ့အဝၩအ့ၬ.",
			"4": "<sup>4</sup> ဘဲၫနီၪၥိၭဖုၥံၪဝဲၥံၪဧ့, နၥံၪဝ့ၫဒၪယီၩ နၥံၪၥံၫဒၪခွံၬဆ့ ယူၭဆၧမၪလူၬ လၧဎရံၬအမိၡါအကၠီၩ့ဘဲၫၥိၭနၥံၪ မိဘၪဆၧအီၪဎုၬထဲၩ့ လၧၦလဂၩဒၪ, လၧအဂဲထုၪ့ထဲၩ့ လၧဆၧၥံၫ, ဘဲၫၥိၭပမိၥၪထၪ့ လၧယွၩအဂးလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ လၧပအီၪလၧပဖံၭပယၪအဖၧၩ့နီၪ, ဆၧ လဲးဆၧဘျၪလဖၪ လၧဆၧမၪလူၬအကၠီၩ့နီၪ, မၩဆၧ လၧပဂၩ့လဖၪအကျၩ ဘဲၫပမိၥၪထၪ့ လၧဆၧၥံၫအဂး",
			"6": "<sup>6</sup> အၥိၭလီၫ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ပၥံၫယူၭလၧဆၧလၧ အဖီၪ့ထၬပၧၩနီၪ, ပဖီၩ့ဖျ့ၭလၧဆၧမၪလူၬ ဘဲၫၥိၭပမိ မၩဆၧအၥၫ့ လၧအဘၪဆဲၫ့လၧၥၭတၭ, မွဲဆၧလးလံၩ လၧအအီၪကွ့ၭအၥၭအ့ၬ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲပမိစံၭဆၧနီၪလဲၪ. ဆၧမၪ လူၬနီၪမွဲ ဆၧဒဲၩဘၭဆ့ဧၪ, မွဲလၩလါအ့ၬ. အ့ၪလမွဲ ဘၪဆၧမၪလူၬနီၪ ယၥ့ၪယၫဆၧဒဲၩဘၭအ့ၬ. အဂဲး ဘဲၫယီၩဆၧမၪလူၬ အ့ၪလစံၭဘၪ, ထီးၥၭကွံၩဆၧလ",
			"8": "<sup>8</sup> ဂ့ၩနီၪ, ယၥ့ၪယၫဆၧၥၭကွံၩအ့ၬ.- အ့ၪမွဲဆၧဒဲၩဘၭ မၩန့အလး လၧဆၧမၪလူၬတၭ, မၩအီၪထၪ့ဆၧၥၭ ကွံၩထီးအလူၬ လၧယဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩဆၧမၪ လူၬအ့ၪလအီၪဘၪနီၪ, ဆၧဒဲၩဘၭမွဲဆၧၥံၫလီၫ.",
			"9": "<sup>9</sup> လၧအခၪ့ထံၭထီးဆၧမၪလူၬ လအီၪဘၪယမၧၫ့ယ ဝ့ၫနီၪ, မွဲလါနၫ့ဘိၩဆၧမၪလူၬဂဲၫထၪ့တၭ, ဆၧဒဲၩဘၭ",
			"10": "<sup>10</sup> မၧၫ့ထၪ့ဝ့ၫနီၪ ယၥံၫယဝ့ၫလီၫ.- ဆၧမၪလူၬလၧအအီၪ လၧဆၧမၧၫ့အဂးနီၪ, ယဒၪဘၪ လၧအဒုၭအီၪထၪ့",
			"11": "<sup>11</sup> ဆၧၥံၫလီၫ.- အဂဲးဘဲၫယီၩ ဆၧဒဲၩဘၭ မၩန့ဘၪအလး လၧဆၧမၪလူၬ အၪ့လီၫန့ယၧၩတၭ လၧအဝ့ၫအကၠီၩ့",
			"12": "<sup>12</sup> မၩၥံၫခွံၬယၧၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ ဆၧမၪလူၬ နီၪမွဲအဆံၫ့ဎံၪဝ့ၫ, ဆၧအလူအထၫနီၪ မွဲအဆံၫ့အ ဎံၪ,ဒဲအတီၩအလီၩ့ အဂ့ၩအဘွၩလီၫ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧဂ့ၩဆၧဘွၩနီၪ မွဲအကဲၪ ထၪ့ဆၧၥံၫလၧယဂးဆ့ဧၪ, မွဲလၩလါအ့ၬ. မွဲဆၧဒဲၩ ဘၭဘဲၫအမိဖျီၪ လၧအမွဲဆၧဒဲၩဘၭနီၪ, မၩၥံၫယၧၩ လၧဆၧဂ့ၩ, ဘဲၫၥိၭဆၧဒဲၩဘၭ မိကဲၪလၧဆၧဒဲၩဘၭ",
			"14": "<sup>14</sup> အဒိၪအမု လၧဆၧမၪလူၬအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ပၥ့ၪယၫ လၧဆၧမၪလူၬ ဘၪဆဲၫ့လၧၥၭနီၪလီၫ. အ့ၪမွဲ ယဝ့ၫဒၪယီၩ ယဘၪဆဲၫ့ လၧဆၧဖံၭဆၧယၪတၭ, ယ ဘၪဆၧအၪ့ဆၫခွံၬ လၧဆၧဒဲၩဘၭအစူၪဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩ ဆၧလၧယမၩယဝ့ၫနီၪ ယအဲၪဒိၭယ ဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ ဆၧလၧယဆိၫ့န့ဘၪနီၪ ယလ မၩဘၪယဝ့ၫတၭ, အ့ၪမွဲဆၧလၧယမ့ၬလဲၩ ယဝ့ၫနီၪ, ယမၩအဝ့ၫလီၫ.",
			"16": "<sup>16</sup> မွဲလါနၫ့ဆၧလၧ ယလဆိၫ့န့ဘၪနီၪ, အ့ၪယမၩအ ဝ့ၫတၭ, ယအုၩ့လၩ့ လၧဆၧမၪလူၬမွဲဆၧဂ့ၩဆၧဘွၩ",
			"17": "<sup>17</sup> လီၫ.- ဘိၩ့နဲၪ့ယီၩ ဆၧလၧယမၩဆၧနီၪလမွဲလၧၩ့ဘၪ ယမၩတၭ, မွဲဆၧဒဲၩဘၭလၧအအီၪဝ့ၫ လၧယဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ယၥ့ၪယၫလၧဆၧဂ့ၩ အီၪလၧယဖၧၩ့ ဘဲၫၦစံၭဆၧအၥိၭလၧယဖံၭ ယယၪ အဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆိၫ့န့ဘၪဆၧဂ့ၩနီၪ အီၪလၧယၧၩတၭ,",
			"19": "<sup>19</sup> အ့ၪမွဲမၩဆၧဂ့ၩနီၪ ယဒၪန့အ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧ ဂ့ၩလၧယဆိၫ့န့နီၪ ယမၩအဝ့ၫအ့ၬ. အ့ၪမွဲဆၧအၧၩ့",
			"20": "<sup>20</sup> လၧယလဆိၫ့န့ဘၪနီၪ ယမၩအဝ့ၫလီၫ.- ဆၧလၧယလ ဆိၫ့န့ဘၪနီၪ အ့ၪယမၩအဝ့ၫတၭ, လမွဲလၧၩ့ဘၪယမၩ တၭ, မွဲဆၧဒဲၩဘၭလၧအအီၪဝ့ၫ လၧယဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဒၪန့ဆၧမၪလူၬလမံၩ့ယီၩ, ထီးယအ့ၪဆိၫ့မၩဆၧဂ့ၩတၭ, ဆၧအၧၩ့အီၪလၧယ",
			"22": "<sup>22</sup> ဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ ထီးဒၪဆၧဘၪဆဲၫ့ လၧၥၭ ခံဖၧၩ့နီၪ ယမုၬလၩလၧယွၩ အဆၧမၪလူၬ အဖၧၩ့",
			"23": "<sup>23</sup> လီၫ.- မွဲလါနၫ့ယဒၪန့ ဆၧမၪလူၬအဂူၫဂၩအီၪလၧ ယဂၩ့လဖၪအကျၩ လၧအဒုၭလိၬအၥၭ လၧယၥၭအ ဆၧမၪလူၬတၭ, ဒုၭကဲၪထၪ့ယၧၩလၧဆၧဒဲၩဘၭ အဆၧမၪလူၬအီၪလၧယဂၩ့လဖၪ အကျၩအဎီးလီၫ.",
			"24": "<sup>24</sup> ၦၡၪ့ဖိၪယၬဖိၪယၧၩယီၩဧ့, မွဲပလၫမိမၩဖီၩ့မၩဖျ့ၭ",
			"25": "<sup>25</sup> ယၧၩလၧမိၡါယီၩ အဆၧၥံၫလဂၩလဲၪ.-ယအၪ့အူၭ ထၪ့ယွၩအခိးအတၩ လၧပကဆါယ့ၫရှူၬဎရံၬအ ကၠီၩ့နီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယနၫ့ဆါဒၪယဝ့ၫ ယီၩ, ယမၩယွၩအဆၧမၪလူၬ လၧၥၭနီၪလီၫ. အ့ၪမွဲ လၧဆၧဖံၭဆၧယၪနီၪ ယမၩဆၧဒဲၩဘၭ အဆၧမၪလူၬ လီၫ."
		},
		"8": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအအီၪလၧယ့ၫရှူၬဎရံၬ အဖၧၩ့လဖၪနီၪ ဆၧစ့ၩရၫ့စၪအီၪ လၧအဝ့ၫၥံၪအ့ၬ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩ ဆၧမၪလူၬဘၪဆဲၫ့ လၧဆၧမၧၫ့လၧယ့ၫ ရှူၬဎရံၬအဖၧၩ့နီၪ, မၩဖီၩ့ဖျ့ၭယူၭယၧၩ လၧဆၧမၪ",
			"3": "<sup>3</sup> လူၬဘၪဆဲၫ့ လၧဆၧဒဲၩဘၭ, ဒဲဆၧၥံၫယူၭလီၫ.- အ ဂဲးဘဲၫယီၩ ဆၧမၪလူၬအဂဲးအဘၭဆါဝ့ၫ လၧဆၧဖံၭ ဆၧယၪအကၠီၩ့နီၪ, ဆၧလၧအမၩဝ့ၫလၥ့ၪဘၪနီၪ, ယွၩအၪ့မၧၫ့လၩ့ အဖိၪခွၫဒၪဝ့ၫအီၪလၧဆၧဖံၭဆၧ ယၪမၪအခံးအဂၩ့တၭ, စ့ၩရၫ့စၪဆၧဒဲၩဘၭ အီၪလၧ",
			"4": "<sup>4</sup> ဆၧဖံၭဆၧယၪအလီၩ့ လၧဆၧဒဲၩဘၭအကၠီၩ့,- ဘဲၫ ၥိၭဆၧမၪလူၬအထူၫအရူၫ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧပ ဖၧၩ့ယီၩ, လၧပလ့ၩဘၪဝ့ၫ ထီးဒၪဆၧဖံၭဆၧယၪနီၪ",
			"5": "<sup>5</sup> လမွဲဘၪတၭ, မွဲထီးဒၪၥၭမုလီၫ.- အဂဲးဘဲၫယီၩ ၦ ဘၪဆဲၫ့လၧဆၧဖံၭဆၧယၪလဖၪနီၪ ဆီၫ့မီၪ့ဝ့ၫလၧဆၧ ဖံၭဆၧယၪအဆၧအဂဲးအကၠီၪ့လီၫ. အ့ၪမွဲၦဘၪဆဲၫ့ လၧၥၭမုလဖၪနီၪ, လၧၥၭမုအဆၧအဂဲးအကၠီၪ့လီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ ဆၧဖံၭဆၧယၪ အဆၧဆီၫ့မီၪ့နီၪ မွဲဆၧ ၥံၫတၭ, အ့ၪမွဲၥၭမုအဆၧဆီၫ့မီၪ့နီၪ မွဲဆၧမၧၫ့ ဒဲဆၧ",
			"7": "<sup>7</sup> ရှူၪဆၧမုၬလီၫ.- အဂဲးဘဲၫယီၩ ဆၧဖံၭဆၧယၪအဆၧ ဆီၫ့မီၪ့နီၪ ထၫ့ဒုၪဒၩယွၩလီၫ. အဂဲးဘဲၫယီၩလခိၭနၪ ဘၪယွၩအဆၧမၪလူၬတၭ, မွဲအခိၭနၪဝ့ၫလၥ့ၪဘၪအ",
			"8": "<sup>8</sup> ဂဲးလီၫ.- တၭၦအီၪလၧဆၧဖံၭဆၧယၪ အဖၧၩ့လဖၪ",
			"9": "<sup>9</sup> နီၪမၩဘၪယွၩအၥၭၥ့ၪအ့ၬ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, ယွၩအၥၭမုအ့ၪအီၪဂုးခၧၫ့ဝ့ၫ လၧနၥံၪအဖၧၩ့တၭ, န ၥံၪလအီၪဘၪ လၧဆၧဖံၭဆၧယၪအဖၧၩ့ မွဲနၥံၪအီၪလၧ ၥၭမုအဖၧၩ့လီၫ. တၭၦလၧအလအီၪဘၪဝ့ၫ လၧဎရံၬ",
			"10": "<sup>10</sup> အၥၭလဂၩဂၩနီၪ, မွဲဎရံၬအၡၩအ့ၬ.- အ့ၪမွဲဎရံၬအ့ၪ အီၪလၧနၥံၪအဖၧၩ့တၭ, မိၡါၥံၫဝ့ၫ လၧဆၧဒဲၩဘၭအ ကၠီၩ့နီၪ, အ့ၪမွဲၥၭမၧၫ့ဝ့ၫ လၧဆၧတီၩဆၧလီၩ့အကၠီၩ့",
			"11": "<sup>11</sup> လီၫ.- တၭၦလၧအဒုၭဂဲထုၪ့ထဲၩ့ ယ့ၫရှူၬလၧဆၧၥံၫအ ဖၧၩ့နီၪအၥၭအ့ၪအီၪဂုးခၧၫ့ဝ့ၫ လၧနၥံၪအဖၧၩ့တၭ, ၦ လၧအဒုၭဂဲထုၪ့ထဲၩ့ ဎရံၬလၧဆၧၥံၫအဖၧၩ့နီၪ,မိ မၩမၧၫ့ထၪ့ထဲၩ့နၥံၪအမိၡါလၧဆၧၥံၫၥ့ၪနီၪ လၧအဝ့ၫ ဒၪအၥၭမု လၧအအီၪဂုးခၧၫ့ဝ့ၫ လၧနၥံၪအဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ဖုၥံၪဝဲၥံၪဧ့, ဘဲၫၥိၭပမိမၧၫ့ထီး ဒၪဆၧဖံၭဆၧယၪအဖၧၩ့ယီၩ,ပဒ့ၪပမါအီၪလၧပ",
			"13": "<sup>13</sup> ဖံၭပယၪအလီၩ့အ့ၬ.- အဂဲးဘဲၫယီၩ နၥံၪအ့ၪမၩထီး ဒၪဆၧဖံၭဆၧယၪတၭ, နၥံၪမိၥံၫလီၫ.- အ့ၪမွဲလၧၥၭမု အကၠီၩ့နီၪ, နၥံၪအ့ၪမၩၥံၫနၥံၪအမိၡါ အဆၧမၩတၭ, နၥံၪမိမၧၫ့လီၫ.",
			"14": "<sup>14</sup> အဂဲးဘဲၫယီၩ ကယဲၦလၧယွၩအၥၭမုလ့ၩၥိၫ့ဝ့ၫ",
			"15": "<sup>15</sup> လဖၪနီၪ, မွဲယွၩအဖိၪၥံၪကိၭဂၩဒ့ၭလီၫ.- အဂဲးဘဲၫ ယီၩနၥံၪန့ဘၪဎီးအၥၭ, ဘဲၫၥိၭနၥံၪမိဘၪ ၥၭမဲၪၥၭဖျဲၩ့ ဒီၭနီၪလမွဲဘၪ, မွဲနၥံၪန့ဘၪဖိၪအၥၭတၭ, ပကိၭ",
			"16": "<sup>16</sup> ထၪ့, အၫဘၭ,ဖါဧ့, နီၪလီၫ.- ဆၧလၧၥၭမုနီၪ အနၫ့ ဆါဒၪဝ့ၫ ထိးဎုၬအၥၭ လၧပၥၭလၧပမွဲယွၩအဖိၪ",
			"17": "<sup>17</sup> ၥံၪလီၫ.- အ့ၪပမွဲအဖိၪၥံၪနီၪ, ပမွဲၦလၧအန့ဘၪဆၧဖ့ၪ ၥၫလဖၪဆ့, ၦန့ၥၫဆၧလၧယွၩနီၪ, ဒဲၦလၧအန့ဘၪ ဆၧဖ့ၪၥၫဎုၬလၧဎရံၬ, ဘဲၫၥိၭပအ့ၪဘၪဎုၬ ဆၧၡၪ့ ဆၧနၭလၧအဝ့ၫတၭ, ပမိဘၪဎုၬ ဆၧလၩဆၧဖၩ့ လၧ အဝ့ၫနီၪဆ့ လီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ယအီၪက့ၪယၥၭ လၧဆၧၡၪ့ဆၧနၭ အထီထီးယီၩ ကြၨၭဘၪဆၧယိဎီၩ့ဝ့ၫလၧဆၧအ",
			"19": "<sup>19</sup> လၩအဖၩ့ လၧအမိဖျီၪထၪ့ လၧပဖၧၩ့ယီၩအ့ၬ.- အဂဲး ဘဲၫယီၩ ဆၧဘၪကဲၪထၪ့ အဆၧဆိၫ့န့နီၪ, ယိလါယွၩ",
			"20": "<sup>20</sup> အဖိၪၥံၪ အဆၧအီၪဖျီၪအဖၧၩ့ၥၭလီၫ.- ဆၧဘၪကဲၪ ထၪ့နီၪဘၪဆၧအီၪက့ၪဝ့ၫ လၧဆၧအုၪၥ့ၪအစူၪဖၧၩ့, ထီးဒၪအၥၭလမွဲဘၪ, မွဲလၧၦအီၪက့ၪအဝ့ၫ လၧဆၧ",
			"21": "<sup>21</sup> အဖၫ့လၬအဂဲး လၧဆၧယိလါအဖၧၩ့နီၪ,- အဂဲးဘဲၫ ယီၩ ဆၧဘၪကဲၪထၪ့ဒၪလ့ၬ မိဖီၩ့ဖျ့ၭ လၧဆၧအုၪၥ့ၪ အဆၧကဲၪဎီးနီၪမိလ့ၩနုၬဝ့ၫ လၧယွၩအဖိၪလဖၪအ",
			"22": "<sup>22</sup> ဆၧပျီၩဖျ့ၭ အလၩအဖၩ့အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ ပၥ့ၪယၫလၧကယဲဆၧဘၪကဲၪထၪ့ ထီးအလူၬဂၪ့အုၩ",
			"23": "<sup>23</sup> ဂၪ့ထိၬဎုၬဒဲဎဲၫဎုၬ ခီးဘိၩ့နဲၪ့ယီၩလီၫ.- မွဲန့ၫဆၧနီၪ လကၭလၧၩ့း အ့ၪမွဲၦအီၪလၧၥၭမုအဆၧၥၪဆိၫဝ့ၫလဖၪ, ပဝ့ၫဒၪယီၩပနၫ့ဆါဒၪပဝ့ၫဒၪလ့ၬ, ပဂၪ့အုၩဂၪ့ထိၬ ဆ့လၧပၥၭခံဖၧၩ့တၭ, ပယိလါဖိၪအလး ဘဲၫပစံၭ",
			"24": "<sup>24</sup> ဆၧအၥိၭ, ပမိၡါအဆၧဎွ့ၩန့ထဲၩ့လီၫ.- အဂဲးဘဲၫ ယီၩပန့ဘၪဆၧထိးထဲၩ့တၩ့ထဲၩ့ လၧဆၧယိလါအဖၧၩ့ တၭး အ့ၪမွဲဆၧယိလါ လၧပဒၪဘၪနီၪ, မွဲဆၧယိလါ အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧလၧၦဒၪဘၪနီၪ, မွဲဆၧယိလါ",
			"25": "<sup>25</sup> ဒံၭဘဲၫၥ့ၪလဲၪ.- အ့ၪမွဲဆၧလၧပလဒၪဘၪနီၪ, ပအ့ၪ ယိလါဝ့ၫတၭ, ပအီၪခိၭအဝ့ၫ လၧပၥၭဆၧၩ့လီၫ.",
			"26": "<sup>26</sup> ဘဲၫနီၪအၥိၭ, ၥၭမုမၩဘိၭမၩဆၧၩ့ ပဂဲးဆါပဘၭ ဆါလဖၪလီၫ အဂဲးဘဲၫယီၩ ဆၧလၧပကြၨၭအၪ့ကံၩ့ ဘၩဆိၪဖၪဆၧနီၪ ပၥ့ၪယၫအ့ၬ. အ့ၪမွဲၥၭမုအနၫ့ဆါ ဒၪဝ့ၫအၪ့ကံၩ့န့ပဂး လၧပဂၪ့အုၩဂၪ့ထိၬ ထီးပလီၩ",
			"27": "<sup>27</sup> လၥ့ၪဘၪလီၫ.- ၦလၧအအၪ့ဎၬ ၥ့ၪယၫၦၥၭနီၪ, မွဲ အၥ့ၪယၫၥၭမုအဆၧဆီၫ့မီၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩမွဲ အအၪ့ကံၩ့န့ဝ့ၫ လၧၦဆံၫ့ဎံၪအဂး ထီးဒၪယွၩအၥၭ လီၫ.",
			"28": "<sup>28</sup> ပၥ့ၪယၫၦလၧအအဲၪယွၩ, ၦလၧအဘၪဆၧကိၭဝ့ၫ ဘဲၫအဆၧစ့ၩရၫ့ဝဲၩဝ့ၫအၥိၭနီၪ, ဆၧထီးအလူၬမၩ",
			"29": "<sup>29</sup> ဂ့ၩဎုၬအၥၭ လၧအဝ့ၫၥံၪအဂးလီၫ.- အဂဲးဘဲၫယီၩ ၦ လၧအၥ့ၪယၫဝဲၩဝ့ၫလဖၪနီၪ, မွဲအစ့ၩရၫ့ဝဲၩဝ့ၫဘဲၫ ၥိၭအဝ့ၫၥံၪ မိလၩ့ဂၬလိၬအၥၭ လၧအဖိၪခွၫ အခံးအ ဂၩ့ဆ့ဘဲၫၥိၭ အဝ့ၫဒၪမိကဲၪထၪ့ အဝဲၡါလၧထၧၫ့ဖုဝဲ",
			"30": "<sup>30</sup> အၪဂၩအကျၩလီၫ.- ၦလၧအစ့ၩရၫ့ ဝဲၩဝ့ၫလဖၪနီၪ,မွဲ အကိၭထဲၩ့အဝ့ၫၥံၪဆ့, ၦလၧအကိၭထဲၩ့ဝ့ၫလဖၪ နီၪ,မွဲအအီၪက့ၪတီၩအီၪက့ၪလီၩ့ အဝ့ၫၥံၪဆ့တၭ, ၦလၧအအီၪက့ၪတီၩ အီၪက့ၪလီၩ့ဝ့ၫလဖၪနီၪ, မွဲအ အီၪက့ၪလၩဖၩ့ အဝ့ၫၥံၪဆ့လီၫ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧဆၧလဖၪနီၪအဂဲး,မွဲပမိစံၭ ဆၧနီၪလဲၪ. ယွၩအ့ၪအီၪလၧပဂးတၭ, မွဲပလၫမိထၫ့",
			"32": "<sup>32</sup> ဒုၪဒၩ ပၧၩလဂၩလဲၪ.- ၦလၧအလလီၫ့ကီၩ့ဘၪအ ဖိၪခွၫဒၪဝ့ၫ လဂၩနီၪ, အ့ၪမွဲဖ့ၪလၫ့ခွံၬဝ့ၫ လၧပဝ့ၫဒၪ ကိၭဂၩဒ့ၭအဂးတၭ, မွဲအလမိဖ့ၪလၫ့ယီၫဘၪပၧၩလၧ အဝ့ၫနီၪအၥိၭဆ့ လၧဆၧထီးအလူၬလဖၪတၭ, မိအီၪ",
			"33": "<sup>33</sup> ဝ့ၫဘဲၫၥ့ၪလဲၪ.- မွဲပလၫမိအီၪက့ၪ ဆၧမၪလၧၦၡၩလၧ ယွၩရွံန့ဝ့ၫလဖၪ အလီၩ့လဂၩလဲၪ,ၦလၧအအီၪ",
			"34": "<sup>34</sup> က့ၪတီၩအီၪက့ၪလီၩ့ ဆၧနီၪမွဲယွၩလီၫ.- မွဲပလၫမိ စ့ၩရၫ့စၪဆၧလဂၩလဲၪး ၦလၧအၥံၫမွဲဎရံၬနီၪ, လၧနီၪ အဖၫ့ခိၪ ဂဲထုၪ့ထဲၩ့ဝ့ၫတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧယွၩအစူၪ",
			"35": "<sup>35</sup> ထွ့ၪနီၪ, အၪ့ကံၩ့န့ဆၧလၧပဂးဆ့လီၫ.- မွဲပလၫမိမၩ လၩ့မုလၩ့ဖၭပၧၩ လၧဎရံၬအဆၧအဲၪ ဆၧကွံၩလဂၩ လဲၪ, မွဲဆၧၡၪ့ဆၧနၭဆၧခိဆၧဝီၩ, ဆၧမၩအၧၩ့ပၧၩ, ဆၧၥၭဝံပၥၭ, ဆၧအီၪဘိၪ့, ဆၧၥၭမဲၪအလး, ဎ့ၬၥံၪ",
			"36": "<sup>36</sup> နၭၥံၪဆ့ဧၪ.- မွဲအ့ၬ, ဘဲၫဆၧကွ့ၭအၥၭ အၥိၭနီၪ, ပဝ့ၫဒၪယီၩပဘၪဆၧမၩၥံၫပၧၩ လၧနကၠီၩ့ၥံၫ့ၥံၫ့နံၩလီၫ. ဆၧအီၪက့ၪပၧၩဘဲၫၥိၪလၧအမိဘၪ ဆၧမၩၥံၫဝ့ၫအၥိၭလီၫ.",
			"37": "<sup>37</sup> အ့ၪမွဲလၧဆၧနီၪလဖၪ ထီးအလူၬအဖၧၩ့နီၪ, ပမွဲ ၦလၧအမၩနၧၩ့မၩစၪ ဆၧဒိၪလါကဲၪကၩ လၧၦလၧ",
			"38": "<sup>38</sup> အအဲၪယူၭပၧၩအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩ ယနဲၩ လၧဆၧၥံၫမွဲဂ့ၩ, ဆၧမၧၫ့မွဲဂ့ၩ, အၥီၫ့မွဲဂ့ၩ, ဆၧအ ဒိၪအခိၪမွဲဂ့ၩ, ဆၧအစီၩ့အမၩ့မွဲဂ့ၩ, ဆၧအီၪမွဲဂ့ၩ,",
			"39": "<sup>39</sup> ဆၧလအီၪဘၪမွဲဂ့ၩ,- ဆၧလၧထၭလခီၫမွဲဂ့ၩ, ဆၧလၧ လၬလခီၫမွဲဂ့ၩ, ဆၧဘၪကဲၪထၪ့အဂူၫဂၩမွဲဂ့ၩ, မၩ လၩ့မုလၩ့ဖၭပၧၩ လၧယွၩအဆၧအဲၪဆၧကွံၩအီၪလၧ ပကဆါယ့ၫရှူၬဎရံၬအဖၧၩ့ လၥ့ၪဘၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ယကၪ့ၡၧၫ့ထိးအၥၭ လၧယဂးလၧၥၭမုဆံၫ့ဎံၪအ ဖၧၩ့, လၧယလချဲၩ့ဘျံၭချဲၩ့ဘျၪဘၪတၭ, ယစံၭဆၧမွဲ",
			"2": "<sup>2</sup> ဆၧတီၩလၧဎရံၬအဖၧၩ့,- လၧယၥၭအုၭဒိၪမၬတၭ,",
			"3": "<sup>3</sup> ယၥၭခိထံၪဎးလီၫ.- အဂဲးဘဲၫယီၩ ယဆိၫ့လၧယဘၪ ဆၧဆိၪအၧၩ့ လၧဎရံၬနီၪလၧၦထၧၫ့ဘူၭထၧၫ့ထံးလၧ ယၧၩဘဲၫဆၧဖံၭဆၧယၪအၥိၭ, ယထၧၫ့ဖုဝဲလဖၪအ",
			"4": "<sup>4</sup> ဂးလီၫ.- အဝ့ၫၥံၪနီၪမွဲ ၦအံၫစရ့လၭဖိၪတၭ, ဆၧအီၪ က့ၪအဝ့ၫၥံၪလၧအဖိၪ, ဒဲဆၧအလၩအဖၩ့ဒဲဆၧအုၩ့ လၩ့လဖၪ, ဒဲဆၧဖ့ၪလၫ့ဆၧမၪလူၬ,ဒဲဆၧမၩနီၪ,ဒဲ ဆၧလီၩဝဲၩလဖၪအီၪဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> ဖါၥံၪနီၪမွဲအဆၧတၭ, ထီးဒၪအဖံၭအယၪဎရံၬလၧ အအီၪလၧဆၧထီးအလူၬအဖၫ့ခိၪ,ယွၩလၧအဘၪ ဆၧဆိၪဂ့ၩ အဆိၩဆိၩ အကၠၪကၠၪလဂၩနီၪ ဘၪဆဲၫ့ လၧအဝ့ၫၥံၪဆ့, အၩမံၩ့.",
			"6": "<sup>6</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, ဘဲၫယွၩအလူဂၭဂီၩ့ဝ့ၫအၥိၭ မွဲအ့ၬ. အဂဲးဘဲၫယီၩ ၦဘၪဆဲၫ့လၧအံၫစရ့လၭ, မွဲၦ",
			"7": "<sup>7</sup> အံၫစရ့လၭဖိၪထီးအလူၬအ့ၬ.- မွဲစအၫဘြဟၫ့အ ချံၫအၥၪလါနၫ့နီၪ, မွဲအဖိၪထီးအလူၬအ့ၬ. အ့ၪမွဲဆၧ",
			"8": "<sup>8</sup> မိကိၭထဲၩ့နချံၫနၥၪလၧစအံစၭအဖၧၩ့လီၫ.- ဘဲၫၦ စံၭဆၧအၥိၭ, ဖိၪလဖၪလၧအဘၪဆဲၫ့ လၧဆၧဖံၭဆၧ ယၪနီၪ မွဲယွၩအဖိၪအ့ၬ. အ့ၪမွဲၦလၧအဘၪဆဲၫ့ လၧ ဆၧလီၩဘၪဝဲၩလဖၪနီၪဆၧအီၪက့ၪအဝ့ၫၥံၪလၧအ",
			"9": "<sup>9</sup> ချံၫအၥၪလီၫ.- အဂဲးဘဲၫယီၩ ဆၧလီၩဘၪဝဲၩဆၧမွဲအ ယီၩ ထီး အ ထီ ယီၩ အ့ၪ ဘၪ နီၪ ယ မိ ဂဲၫ",
			"10": "<sup>10</sup> တၭ, နး စၫ ရၫ မိ အီၪ လၧ အ ဖိၪ ခွၫ လီၫ.- မွဲ န့ၫဆၧနီၪလကၭလၧၩ့, အ့ၪမွဲထီးနးရဘ့ၭကၫဒၧၩ့",
			"11": "<sup>11</sup> ထၪ့ဝ့ၫလၧပဖါ စအံစၭလဂၩတၭ,- အဂဲးဘဲၫယီၩဖိၪ ၥၪလဖၪ လချႃၭအီၪဖျဲၪဒံၭဘၪနီၪ, ဆၧဂ့ၩမွဲဂ့ၩ, ဆၧ အၧၩ့မွဲဂ့ၩ, လချႃၭမၩဒံၭဘၪတၭ, ဘဲၫၥိၭယွၩအဆၧ ကိၭဝဲၩဘဲၫဆၧရွံန့ဝ့ၫအၥိၭ, မိအီၪဂုးခၧၫ့ဝ့ၫ လၧဆၧ",
			"12": "<sup>12</sup> မၩလမွဲဘၪ, မွဲလၧအကိၭထဲၩ့ဝ့ၫအဂဲး,- ဆၧလီၩဘၪ",
			"13": "<sup>13</sup> အဝ့ၫ, ဖိၪဝဲၡါမိဘၪမၩအဖုအဆၧလီၫ.- ဘဲၫဆၧကွ့ၭ အၥၭအၥိၭ, စယၫကူၭနီၪယအဲၪယူၭ, အ့ၪမွဲစအံစီၫနီၪယမ့ၬလဲၩယူၭ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ပမိစံၭဆၧနီၪလဲၪ. ဆၧလတီၩ လလီၩ့ဘၪနီၪ, မွဲအအီၪလၧယွၩဆ့ဧၪးမွဲလၩလါ",
			"15": "<sup>15</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫစံၭစမိစ့ၭ, ထီး ဒၪ ၦ လၧ ဆၧ မိ ယၫ့ ၥၭ ဘၪ ယ ၥၭ လ ဂၩ ဂၩ နီၪ, ယ ယၫ့ ၥၭ အ ဝ့ၫ လီၫ. ထီး ဒၪ ၦ လၧ ဆၧ မိ ၥၭ အီၪ ဘၪ ယ ၥၭ လ ဂၩ ဂၩ နီၪ, ယ ၥၭ မိ",
			"16": "<sup>16</sup> အီၪ အ ဝ့ၫ လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦဆိၫ့ဆၧမွဲ ဂ့ၩ,ၦစဲၪ့မွဲဂ့ၩ, ဆၧလဘၪဆဲၫ့ဘၪ လၧအဝ့ၫနီၪတၭ,မွဲ",
			"17": "<sup>17</sup> အဘၪဆဲၫ့လၧယွၩ လၧအယၫ့ၥၭဆၧလီၫ.- အဂဲးဘဲၫ ယီၩ ဆၧကွ့ၭအၥၭ လီၩဘၪစဖၫရိၫဘဲၫယီၩ,ဘဲၫ ယ မိ ဒုၭ နဲၪ ယ စီၩ့ ယ မၩ့ လၧ န ဖၧၩ့, ဘဲၫ ၥိၭ ယ မိ ဒုၭ ဂၧၫ့ ထၪ့ ၥၩ လၩ့ ယ မံၩ့ လၧ ခး ဖၧၩ့ ထၧၫ့ ဘံၪ့ ယၫ, ယ ဒုၭ အီၪ ထၪ့ နၧၩ န့ၫ",
			"18": "<sup>18</sup> လၧ ဆၧ နီၪ လ မံၩ့ အ ဂး လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ, အဆၧယၫ့ၥၭၦ လၧအမိယၫ့ၥၭဘၪအၥၭနီၪ, ၦ လၧဆၧမိမၩနီၩ့ဝ့ၫ အၥၭတၭ, မၩဝ့ၫလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲနမိစံၭယၧၩ, မွဲအအီၪက့ၪ ဒံၭဆၧမၪ မွဲဘၪလဲၪ, အဂဲးဘဲၫယီၩ အဝ့ၫဒၪအၥၭနီၪ",
			"20": "<sup>20</sup> မွဲပလၫပဒၩ့အဝ့ၫလဂၩလဲၪ.- မွဲလါနၫ့ဘိၩ, ၦၡၩဧ့, ၦလၧအချဲၩ့ဆၧၫ့ထၫ့ဒုၪဒၩယွၩ, နဝ့ၫဒၪယီၩ နမွဲပလၫ လဂၩလဲၪ. ဆၧလၧအဘၪကဲၪထၪ့နီၪ မွဲအမိလီၩဘၪၦ လၧအမၩကဲၪထၪ့ဝ့ၫနီၪ, နမၩယၧၩဘဲၫယီၩမွဲဘၪလဲၪ",
			"21": "<sup>21</sup> နီၪဆ့ဧၪ.- ၦလၧအမၩဖၧၩ့ဂၪ့ခိၪနီၪ, မၩဖၧၩ့လၧအ လၩအဖၩ့အီၪတၭ မၩဖၧၩ့လၧအလၩအဖၩ့လအီၪ ဘၪလၧဆၧအလီၪ့လဖျိၪ့ဎးနီၪ အစီၩ့အမၩ့အီၪဝ့ၫ,",
			"22": "<sup>22</sup> မွဲအ့ၬဧၪ.- ဘဲၫနီၪအၥိၭ,ယွၩ,လၧအအွံၪၥၭဆၧၩ့ ယံၬယံၬနီၪ အ့ၪမိဒုၭနဲၪဘၪအၥၭ အဆၧၥၭထၪ့, ဒဲအ စီၩ့အမၩ့ လၧၦတဲၩ့ဝဲၩအၥၭလၧဆၧဂၭဂီၩ့အဂး အ လီၩ့နီၪ,ပစံၭဆၧလမံၩ့မံၩ့အလး အီၪဝ့ၫဘဲၫၥ့ၪလဲၪ.",
			"23": "<sup>23</sup> ဒဲဘဲၫၥိၭ အမိမၩဖျီၪထၪ့ အလၩအဖၩ့ လၧၫ့လၧၫ့ဎွ့ၩ ဎွ့ၩလၧၦန့ဘၪဆၧယၫ့ၥၭအလီၩ့နီၪ, လၧအတဲၩ့",
			"24": "<sup>24</sup> ဝဲၩဝ့ၫ လၧဆၧလၩဆၧဖၩ့အဂးနီၪ,- ဘဲၫၦစံၭဆၧ အၥိၭ,ၦလၧဆၧကိၭဝဲၩဝ့ၫ, ပဝ့ၫဒၪယီၩ, န့ၫၦယုဒၫဖိၪ",
			"25": "<sup>25</sup> ၥံၪနီၪလကၭလၧၩ့, မွဲၦဆၨၩအဂူၫဂၩဆ့,- ဘဲၫအစံၭ ဝ့ၫလၧစဟိၫစံအၫအဖၧၩ့ဆ့, ၦလၧအလမွဲဘၪယခ့ၫယၡၩနီၪ, ယမိကိၭယခ့ၫယၡၩတၭ, ၦမုၪလၧယလအဲၪဘၪလဂၩနီၪ, ယမိကိၭၦမုၪလၧယအဲၪဝ့ၫလီၫ.",
			"26": "<sup>26</sup> ဆၧ မိ မၩ အ ၥၭ လၧ အ လး လၧ ဆၧ လီၩ ဘၪ အဝ့ၫ ၥံၪ, န ၥံၪ ဝ့ၫ ဒၪ ယီၩ န ၥံၪ လ မွဲ ဘၪ ယ ခ့ၫ ယ ၡၩ နီၪ, ထီး နီၪ ဆၧ မိ ကိၭ ထဲၩ့ န ၥံၪ လၧ ယွၩ",
			"27": "<sup>27</sup> လၧ အ မၧၫ့ ဝ့ၫ လ ဂၩ အ ဖိၪ ခွၫ ၥံၪ လီၫ.- စအဲၫစ့ ယၫကိၭထၪ့ဝ့ၫ လၧအံၫစရ့လၭအဂဲး, ၦအံၫစရ့လၭအဖိၪၥံၪအီၪအၪ, ဘဲၫမ့ၭလၧမၫဆမံၭဖၧၩ့အၥိၭလါနၫ့တၭ, ၦၡၩဂၩၥံၪမိထီၩ့လၧဆၧထိးထဲၩ့ တၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"28": "<sup>28</sup> အဂဲးဘဲၫယီၩယွၩမိမၩဂီၩ့ အဆၧမၩတၭ, ဒဲဒၪ့ထ့ၬခွံၬဝ့ၫ လၧဆၧတီၩဆၧလီၩ့အဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ကဆါမိမၩဆၧအဖၨၪ လၧဂၪ့ခိၪချိၫ့ယီၩလီၫ.",
			"29": "<sup>29</sup> ဘဲၫစအဲၫစ့ယၫ စံၭဝဲၩဝ့ၫအၥိၭ, ၦၥုၭမုခမျၧးအကဆါ, အ့ၪလဒုၭအီၪလၩ့ထးဘၪ ၦလၧအမွဲဆၧချံၫတၭ, ပမိကဲၪထၪ့ဘဲၫစီဒၧၫ့အၥိၭ, ဒဲမိလၩ့ဂၬဂမီရၫလီၫ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, ပမိစံၭဆၧနီၪလဲၪ. ၦဆၨၩ လဖၪလၧအလလီၩ့အၪ့ဎၬဘၪ ဆၧတီၩဆၧလီၩ့နီၪ, န့ဘၪဆၧတီၩဆၧလီၩ့,ဘဲၫၦစံၭဆၧအၥိၭ, ဆၧတီၩ",
			"31": "<sup>31</sup> ဆၧလီၩ့ဘၪဆဲၫ့လၧဆၧနဲၩလီၫ.- အ့ၪမွဲၦအံၫစရ့ လၭဖိၪလၧအလီၩ့ ဆၧတီၩဆၧလီၩ့ဘၪဆဲၫ့ လၧဆၧမၪ",
			"32": "<sup>32</sup> လူၬနီၪချႃၭန့ဝ့ၫဒၪအ့ၬ. မွဲအဘၪဆၧနီၪလဲၪ. (မွဲအ လီၩ့အၪ့ဎၬဝ့ၫ) လၧဆၧနဲၩမွဲအ့ၬ. မွဲလၧဆၧမၩဘၪ ဆဲၫ့လၧဆၧမၪလူၬလီၫ. အဂဲးဘဲၫယီၩ လိးဆၧဘၪ ထၧၩ့လဖျိၪ့နီၪ, ၦလဖၪနီၪ ဘၪထၧၩ့ဝ့ၫဒၪဘဲၫဆၧကွ့ၭ",
			"33": "<sup>33</sup> အၥၭအၥိၭနီၪ,- ယိ ခွါ,ယ အီၪ က့ၪ လၩ့ လိး ဘၪ ထၧၩ့ အ လး, လၧ ဆၧ လၩ့ ထံၩ ဖါ အ ဂး လ ဖျိၪ့ လၧ ဇံ အိၫ့ အ ဖၧၩ့ နီၪ လီၫ. က ယဲ ၦ လၧ အ နဲၩ အ ဝ့ၫ လ ဖၪ နီၪ အ မ့ၬ လ မဲ ဘၪ လီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ဖုၥံၪဝဲၥံၪဧ့, ယဆိၫ့ဆၧလၧယၥုၪ့ခံၥၭလဲၫ,ဒဲယဘၩ ဆိၪဖၪယွၩ လၧၦအံၫစရ့လၭဖိၪအဂး, မွဲဘဲၫၥိၭအဝ့ၫ",
			"2": "<sup>2</sup> ၥံၪမိန့ဘၪ ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫ ယီၩယထိးယၥၭလၧအဂး, လၧအဆၧကျ့ၭစၨၭအီၪ ဝ့ၫလၧယွၩအဂးလါနၫ့ဘိၩ,မွဲဘဲၫဆၧၥ့ၪယၫအၥိၭ",
			"3": "<sup>3</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလၥ့ၪယၫဘၪယွၩအဆၧ တီၩဆၧလီၩ့တၭ, အၪ့ဎၬမၩဂုးမၩခၧၫ့ အဆၧတီၩ ဆၧလီၩ့ဒၪဝ့ၫနီၪ, အီၪက့ၪအၥၭ လၧယွၩ အဖၫ့လၬ",
			"4": "<sup>4</sup> အ့ၬ.-အဂဲးဘဲၫယီၩ ဎရံၬမွဲဆၧမၪလူၬအဆၧမၩလၧၫ့ မၩဎွ့ၩလၧဆၧတီၩဆၧလီၩ့အဂး, လၧကယဲၦလၧအ နဲၩဝ့ၫလဂၩလါလါအဂးလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩစမိစ့ၭကွ့ၭဝ့ၫ လၧဆၧတီၩဆၧလီၩ့ ဘၪဆဲၫ့လၧဆၧမၪလူၬအဂဲး,ၦလၧအမၩဆၧနီၪလဖၪ",
			"6": "<sup>6</sup> မိမၧၫ့ဝ့ၫလၧအဖၧၩ့လီၫ.- အ့ၪမွဲဆၧတီၩဆၧလီၩ့ဘၪဆဲၫ့ လၧဆၧနဲၩနီၪစံၭဝ့ၫဘဲၫယီၩ, ဘဲၫၦစံၭဆၧအၥိၭ, ဘဲၫအ မိၥိၫ့လၩ့ဎရံၬအၥိၭနီၪ, မွဲပလၫမိလ့ၩထၪ့လၧမူၭခိၪအဖၧၩ့",
			"7": "<sup>7</sup> လဂၩလဲၪ.- ဘဲၫၦစံၭဆၧအၥိၭ ဘဲၫအမိၥိၫ့ထၪ့ခွံၬဎရံၬ လၧဆၧၥံၫအဖၧၩ့နီၪ, မွဲပလၫမိလ့ၩလၩ့ လၧဆၧယိၬအ ဖၧၩ့လဂၩလဲၪနီၪ, ထီးစံၭလၧနၥံၪအၥၭခံဖၧၩ့လဂ့ၩ.",
			"8": "<sup>8</sup> မွဲအစံၭဆၧနီၪလမံၩ့လဲၪ. အလူအထၫအီၪဘူၭဝ့ၫလၧ နၧၩ,အီၪဝ့ၫလၧနနိၭဖၧၩ့ ဒဲလၧနၥၭခံဖၧၩ့, ဘဲၫၦစံၭဆၧ အၥိၭ, ဆၧအလူအထၫဘၪဆဲၫ့ လၧဆၧနဲၩလၧပလီၩ",
			"9": "<sup>9</sup> လၩ့လၬလၩ့အဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ နအ့ၪအုၩ့လၩ့ ကဆါယ့ၫရှူၬလၧနနိၭ, နအ့ၪနဲၩလၧနၥၭခံဖၧၩ့လၧ ယွၩမၩဂဲထုၪ့ထဲၩ့အဝ့ၫ လၧဆၧၥံၫအဖၧၩ့နီၪ, နမိထီၩ့",
			"10": "<sup>10</sup> လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့နၧၩလီၫ.- အဂဲးဘဲၫယီၩ ၦ နဲၩဆၧလၧအၥၭ လၧဆၧတီၩဆၧလီၩ့အဂဲးတၭ, လၧ အနိၭနီၪ မွဲအအုၩ့လၩ့ ဆၧလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"11": "<sup>11</sup> အဂဲးလီၫ.- အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအၥၭစံၭဝ့ၫဒၪ, က ယဲ ၦ လၧ အ နဲၩ အ ဝ့ၫ ဒၪ လ ဂၩ လါ လါ နီၪ, အ မ့ၬ မဲ ဘၪ အ့ၬ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ ၦယုဒၫဖိၪမွဲဂ့ၩ, ၦဂြံစၭဖိၪမွဲဂ့ၩ,လၩ့ မဲၩအ့ၬ. အဂဲးဘဲၫယီၩ ၦထီးအလူၬအကဆါမွဲလ ဂၩဎးတၭ, ထူၭဝ့ၫလၧၫ့ဝ့ၫ လၧကယဲၦကိၭထၪ့အဝ့ၫ",
			"13": "<sup>13</sup> ထီးအလူၬအဂးလီၫ.- အ ဂဲး ဘဲၫ ယီၩ က ယဲ ၦ လၧ အ ကိၭ ထၪ့ ယွၩ အ မံၩ့ လ ဂၩ လါ လါ နီၪ မိထီၩ့ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ လီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအလနဲၩဘၪဝ့ၫ လဂၩ နီၪ, မွဲအကိၭထၪ့ဝ့ၫ မိၥ့ၪဘဲၫၥ့ၪလဲၪ, ၦလၧအလနါဂၧၫ့ ဘၪဝ့ၫအဂဲးနီၪ, မွဲအမိနဲၩထဲၩ့ဝ့ၫ ဘဲၫၥ့ၪလဲၪ. ၦလီၩ လၩ့လၬလၩ့ဆၧ အ့ၪလအီၪဘၪနီၪ မွဲအမိနါဂၧၫ့ဝ့ၫဘဲၫ",
			"15": "<sup>15</sup> ၥ့ၪလဲၪ.- ဆၧအ့ၪလအၪ့မၧၫ့လၩ့ဘၪနီၪ မွဲအမိလီၩ လၩ့လၬလၩ့ဆၧဘဲၫၥ့ၪလဲၪ. ဘဲၫဆၧကွ့ၭအၥၭစံၭ ဝ့ၫအၥိၭနီၪ, ၦလၧအလီၩ့လၩ့ ဆၧဘၪလိၬအိၭလိၬ အဆၧၥၭ ထိၬအပရၧၫ့, ဒဲၦလၧအဂဲၫဆိၬဆၧဂ့ၩဆၧဘွၩ အဆၧၥၭထိၬအ ပရၧၫ့, အခၪ့လဖၪနီၪ ဎံၫလၩဝ့ၫဆံၭဒိၪလဲၪၬ",
			"16": "<sup>16</sup> မွဲလါနၫ့ဘိၩ, ၦခိၭနၪဆၧၥၭထိၬ အပရၧၫ့ ကိၭဂၩ ဒ့ၭအ့ၬ.အဂဲးဘဲၫယီၩ စအဲၫစ့ယၫစံၭဝ့ၫဒၪ, ကဆါ ဧ့, မွဲ ပ လၫ နဲၩ ပ လီၩ လၩ့ လၬ လၩ့ ဆၧ လ",
			"17": "<sup>17</sup> ဂၩ လဲၪ.- အ့ၪမွဲဘဲၫနီၪတၭ, ဆၧနဲၩဘၪဆဲၫ့လၧ ဆၧနါဂၧၫ့တၭ, ဆၧနါဂၧၫ့နီၪ ဘၪဆဲၫ့လၧယွၩအလူ အထၫလီၫ.",
			"18": "<sup>18</sup> အ့ၪမွဲယစံၭ, မွဲအလနါဂၧၫ့ဘၪဧၪ, နါဂၧၫ့မၬကၨ. အၥီၫဂၧၫ့ထၪ့ယူၭ လၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫနီၪ, ဒဲအလူအထၫထီၩ့ယူၭ လၧဂၪ့ခိၪအထုၬယူၭလီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲယစံၭၦအံၫစရ့လၭဖိၪ, မွဲအလၥ့ၪယၫဘၪ ဧၪ. လၧအခၪ့ထံၭ စမိစ့ၭစံၭဝ့ၫ, ယမိထိၪဂဲၩ နၥံၪအဆၧၥၭကဲၪ့လၧၦလၧအလ မွဲဘၪၦအဆၨၩတၭ, ယမိမၩထၪ့နၥံၪအၥၭ လၧၦၥုၪ့လဖၭၥၭလဖၭ ဘၪအဆၨၩယီၩလီၫ.",
			"20": "<sup>20</sup> စအဲၫစ့ယၫအီၪဝ့ၫ လၧအၥၭဒူၩတၭ, စံၭဝ့ၫဒၪ, ၦလၧအလအၪ့ဎၬ ဘၪယၧၩ လဖၪနီၪ ဒၪန့ယၧၩ တၭ, ၦလၧအလအၪ့စၪ့ဘၪယၧၩလဖၪနီၪ ယနဲၪဖျီၪ ယၥၭ, လၧအမ့ၬယၫလီၫ.",
			"21": "<sup>21</sup> အ့ၪမွဲလၧအံၫစရ့လၭဖိၪအဂဲးနီၪ စံၭဝ့ၫဒၪ, ယယူၬထၪ့ယစူၪ လၧၦလခိၭနၪဘၪဆၧ, ဒဲလၧၦဂဲး လိၬတ့ၭလိၬဆၧလဆၨၩ အအီၪၥံၫ့ၥံၫ့နံၩလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ယစံၭယဝ့ၫ မွဲယွၩခွံၬၡိၭခွံၬ ယူၭအခ့ၫအၡၩ ဒၪဝ့ၫနီၪဆ့ဧၪးမွဲလၩလါအ့ၬ. အ ဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩဒၪလ့ၬ, ယမွဲၦအံၫစရ့လၭ ဖိၪဘၪဆဲၫ့ လၧစအၫဘြဟၫ့အချံၫအၥၪ ဒဲစဘံၪ့ယမံၫ့",
			"2": "<sup>2</sup> အဒီၪ့လီၫ.- ၦလၧယွၩၥ့ၪယၫဝဲၩဝ့ၫ အဆၨၩဒၪဝ့ၫနီၪ, မွဲအခွံၬၡိၭခွံၬဝ့ၫအ့ၬ. ဆၧကွ့ၭအၥၭ လၧစအံၫလဲ ယၫအဂဲး, စံၭဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, မွဲနၥံၪလၥ့ၪ ယၫဘၪဧၪ. အဝ့ၫလဂၩအၪ့ကံၩ့ထၫ့ဒုၪဒၩ ၦအံၫစရ့",
			"3": "<sup>3</sup> လၭဖိၪလၧယွၩတၭ, (စံၭဝ့ၫဒၪ,)- က ဆါ ဧ့, အ ဝ့ၫ ၥံၪ မၩ ၥံၫ ယူၭ န မီၪ လ ဖၪ ယူၭ, ခုၪ့ လၩ့ ဎီး ခွံၬ ယူၭ န ဆၧ လု အ လး ယူၭ, ယ ဝ့ၫ ဒၪ ယ အီၪ လၩ့ ထး လ ဂၩ ဎး တၭ, မွဲ အ အၪ့ ဎၬ",
			"4": "<sup>4</sup> ယ ၥၭ မၧၫ့ ဆ့ လီၫ.- ယွၩ စံၭ ဆၧၫ့ ဝ့ၫ ဘဲၫ ၥ့ၪ လဲၪ, ၦ လၧ အ လ ချံၭ လၩ့ ဘၪ အ ခၪ့ လၧ ဘၫ အ လၭ အ မ့ၬ ယၫ လ ဖၪ နီၪ, ယ အီၪ က့ၪ လၩ့",
			"5": "<sup>5</sup> ထး လၧ ယ ဂး နွ့ၫ ထီၫ့ ယူၭ လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, အခၫဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, ၦအီၪလၩ့ထးလဖၪ ဘဲၫဆၧရွံန့ဘၪဆဲၫ့ လၧဆၧအခိးအတၩ အၥိၭနီၪအီၪ",
			"6": "<sup>6</sup> ဝ့ၫဒၪလီၫ.- အ့ၪဘၪဆဲၫ့ လၧဆၧအခိးအတၩနီၪ,ဘၪ ဆဲၫ့လၧၩ့လၧဆၧမၩအ့ၬ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ဆၧအခိး အတၩ မွဲလၧၩ့ ဆၧအခိးအတၩအ့ၬ. ဎအ့ၪဘၪဆဲၫ့လၧဆၧ မၩတၭ, ဘၪဆဲၫ့လၧၩ့လၧဆၧအခိးအတၩအ့ၬ. အ့ၪလမွဲ ဘၪဘဲၫနီၪတၭ, ဆၧမၩမွဲလၧၩ့ဆၧမၩအ့ၬ.ၭ",
			"7": "<sup>7</sup> အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘဲၫၥ့ၪလဲၪ. ဆၧလၧၦအံၫစရ့ လၭဖိၪအၪ့ဎၬဝ့ၫနီၪန့ဘၪဝ့ၫအ့ၬ. အ့ၪမွဲၦလၧဆၧ ရွံန့ဝ့ၫလဖၪနီၪ န့ဘၪယူၭဝ့ၫယူၭ. ၦအီၪလၩ့ထးလဖၪ",
			"8": "<sup>8</sup> ဆၧမၩနီၩ့အၥၭ,- ဘဲၫဆၧကွ့ၭအၥၭအၥိၭနီၪ, ယွၩ ဖ့ၪ လၫ့ ခွံၬ ဝ့ၫ လၧ အ ၥၭ, မံၫ ခံၫ့ ဒဲ အ မ့ၬ လ ဒၪ ဘၪ ဆၧ, အ နါ လ ဂၧၫ့ ဘၪ ဆၧ, ထီး",
			"9": "<sup>9</sup> မု လ နံၩ ယီၩ လီၫ.- စဒၫဝံၭ စံၭဝ့ၫ, အစပွဲနီၪ, မွဲအကဲၪထၪ့ဆိၭဂ့ၬ ဒဲချီၩ့, ဒဲအဆၧလၩ့ထံၩဖါအလး, ဒဲဆၧဖ့ၪဆၧၫ့ဆၧ အလးလၧအဂးဒၪဝ့ၫဆံၭ.",
			"10": "<sup>10</sup> ဘဲၫၥိၭအထီးဒၪဘၪဆၧလဂ့ၩနီၪ, မွဲအမ့ၬခံၭ, ဒဲ အဖျီးကူၭလၩ့ဝ့ၫလထံၪဎးဆံၭ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ, ယစံၭယဝ့ၫ, မွဲအဘၪထၧၩ့ ဘဲၫအမိလၩ့ထံၩဖါ အၥိၭနီၪဆ့ဧၪး မွဲလၩလါအ့ၬ. အ့ၪမွဲဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဘၪၦဆၨၩလဖၪလၧအ ဝ့ၫၥံၪအဆၧလၩ့ထံၩဖါအကၠီၩ့, ဘဲၫၥိၭဆၧမိထိၪဂဲၩ",
			"12": "<sup>12</sup> အၥၭကဲၪ့လီၫ.- အဝ့ၫၥံၪအဆၧလၩ့ထံၩဖါ အလးနီၪ အ့ၪမွဲဂၪ့ခိၪအထူၭအလၧၫ့တၭ, ဒဲအဆၧလၩ့ၡၩနီၪ, မွဲၦဆၨၩလဖၪ အဆၧထူၭဆၧလၧၫ့တၭ, အဆၧလၧၫ့ ထၪ့ဎွ့ၩထၪ့ဝ့ၫနီၪ, မိမၩအၪနဲၪ့အနီၪဆံၭဒိၪလဲၪ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩ ၦဆၨၩလဖၪ, နၥံၪဝ့ၫဧ့, ယလီၩဘၪ နၥံၪလီၫ. ယမွဲၦဆၧအၪ့မၧၫ့ဖိၪ ဘၪဆဲၫ့လၧၦဆၨၩလ",
			"14": "<sup>14</sup> ဖၪတၭ, ယမိဒုၭလၩဖၩ့ထၪ့ယဆၧမၩ,- ဘဲၫၥိၭယမၩ အ့ၪၥ့ၪတၭ, ယမိထိၪဂဲၩၦလၧယၥွံၪ ယယၪအၥၭကဲၪ့",
			"15": "<sup>15</sup> နီၪထိးထဲၩ့တၩ့ထဲၩ့လနၩ့နၩ့လီၫ.- အဂဲးဘဲၫယီၩ ဆၧခွံၬၡိၭခွံၬအဝ့ၫၥံၪ, အ့ၪမွဲဂၪ့ခိၪအဆၧမၩဘၪလိၬ ထဲၩ့ဝ့ၫတၭ, ဆၧထိးဆၧၫ့ထဲၩ့ဝ့ၫနီၪ, အ့ၪလမွဲဘၪဆၧ မၧၫ့ထၪ့ထဲၩ့ လၧဆၧၥံၫအဖၧၩ့နီၪ မွဲဆၧနီၪလမံၩ့လဲၪ.",
			"16": "<sup>16</sup> ဆၧအၥၪဆိၫနီၪအ့ၪဆံၫ့ဎံၪဝ့ၫ, မိဆံၫ့ထီးအလူၬဆ့ တၭ,ဆၧအဝံအ့ၪဆံၫ့ဎံၪနီၪ အထဲၩ့လဖၪ မိဆံၫ့ဎံၪဝ့ၫ",
			"17": "<sup>17</sup> ဆ့လီၫ.- အထဲၩ့အဖၫ့လနၩ့နၩ့ အ့ၪဘၪဆၧဘိၭခါခွံၬ အၥၭနီၪ, နဝ့ၫဒၪနမွဲၥံၪ့အလဲအိၫ့အမံၩ့လၧဆၧ မၩဘုၭထၬလၧထဲၩ့ၥံၪဖၫ့ၥံၪအလးတၭ, နန့ဎုၬၥံၪ့အ",
			"18": "<sup>18</sup> လဲအိၫ့အဝံဒဲအၥိၪတၭ,- ထီးအီၪက့ၪဖိၫလိၫနၥၭလၧ ထဲၩ့ၥံၪဖၫ့ၥံၪ အဖၫ့ခိၪလဂ့ၩ. အ့ၪနအီၪက့ၪ ဖိၫလိၫ နၥၭတၭ,နလဆိၬဘၪဆၧဝံ, မွဲဆၧဝံဆိၬနၧၩလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, နစံၭနဝ့ၫ, ဆၧမိဘိၭခါခွံၬ ထဲၩ့ ၥံၪဖၫ့ၥံၪ, ဘဲၫၥိၭအမိမၩဘုၭထၬယၧၩ လၧအလး",
			"20": "<sup>20</sup> လီၫ.- မွဲယူၭ, အဝ့ၫၥံၪဘၪဆၧဘိၭခါခွံၬဝ့ၫ လၧဆၧလ နဲၩဘၪအကၠီၩ့နီၪ, နဝ့ၫဒၪယီၩ နအီၪဂုးအီၪခၧၫ့ လၧ ဆၧနဲၩအကၠီၩ့လီၫ. ထီးအီၪက့ၪထၪ့ထီၫနၥၭလဂ့ၩ,",
			"21": "<sup>21</sup> အ့ၪမွဲၥၭမဲၪဆၧဘီၪ.- အဂဲးဘဲၫယီၩ ယွၩအ့ၪလလီၫ့ ကီၩ့ဘၪအထဲၩ့အဖၫ့ဒၪဝ့ၫနီၪ, ဘၪလဘၪလလီၫ့ကီၩ့ ဘၪခိၬနၧၩ, ထီးလၩ့နၥၭဘီၪ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ယိခွါယွၩအခိးအတၩဒဲအစူၪ ဆီၪ့ဆံၭ. အစူၪဆီၪ့နီၪဘၪၦ လၧအလၩ့ထံၩဖါလဖၪ အလီၩ့လီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩနအ့ၪအီၪဂုးခၧၫ့လၧ အခိးအတၩအဖၧၩ့တၭ, ဆၧအခိးအတၩ မိဘၪနၧၩ",
			"23": "<sup>23</sup> လီၫ.- အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, နမိဘၪဆၧဖ့ၬထ့ၬခွံၬ နၧၩလီၫ. အဝ့ၫၥံၪအ့ၪလအီၪဘၪ လၧဆၧလနဲၩ ဘၪအဖၧၩ့နီၪဆၧမိမၩဘုၭထၬထဲၩ့အဝ့ၫၥံၪဆ့လီၫ. အဂဲးဘဲၫယီၩ ယွၩမၩဘုၭထၬထဲၩ့ဒီၭ အဝ့ၫၥံၪ ၥ့ၪ",
			"24": "<sup>24</sup> လီၫ.- အဂဲးဘဲၫယီၩ ဆၧအ့ၪဖ့ၬထ့ၬနၧၩ လၧၥံၪ့အလဲ အိၫ့အမံၩ့အလီၩ့တၭ, အ့ၪမၩဘုၭထၬထဲၩ့နၧၩ လၧၥံၪ့ အလဲအိၫ့အဂ့ၩနီၪ, မွဲအမိမၩဘုၭထၬ အထဲၩ့ အဖၫ့ လၩ့ထံးလၩ့ဆ့ၭ လၧအထံၭဒၪဝ့ၫအလီၩ့ အၪနဲၪ့အနီၪ ဒံၭလီၫ.",
			"25": "<sup>25</sup> ဖုၥံၪဝဲၥံၪဧ့, ယၥၭအီၪလၧနၥံၪ မိၥ့ၪယၫဆၧအီၪၥူၪ ဝ့ၫယီၩ, ဘဲၫၥိၭထီးအီၪက့ၪနၥံၪအၥၭ လၧနၥံၪအဆၧ ကိၪ့ဘၪကိၪ့ၥ့ၪ ဒၪဝ့ၫအဖၧၩ့လဂ့ၩ, လၧၦဆၨၩလဖၪ အဆၧလၧၫ့ထၪ့ဎွ့ၩထၪ့ လချႃၭဂဲၫနုၬဒံၭဘၪနီၪ, ဆၧၥုၪ့နီၩ့ၥၭနီၩ့ဘၪယူၭ ၦအံၫစရ့လၭဖိၪလနၩ့နၩ့",
			"26": "<sup>26</sup> လီၫ.- ဘဲၫနီၪအၥိၭ ၦအံၫစရ့လၭဖိၪ ထီးအလူၬမိထီၩ့ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့, ဘဲၫဆၧကွ့ၭအၥၭအၥိၭ, ၦ ထုၭ ထၪ့ န့ ဆၧ လ ဂၩ နီၪ မိ ဂဲၫ ထၪ့ လၧ ဇံ အိၫ့ အ ဖၧၩ့ တၭ, မိ ဒုၭ စဲၪ့ ထၪ့ ခွံၬ ဆၧ",
			"27": "<sup>27</sup> အၧၩ့ လၧ စ ယၫ ကူၭ အ ဖၧၩ့ လီၫ.- ထီး ယ ဆိၬ ထၪ့ ခွံၬ အ ဝ့ၫ ၥံၪ အ ဆၧ ဒဲၩ ဘၭ နီၪ, ယ ဆၧ",
			"28": "<sup>28</sup> အုၩ့ လၩ့ လၧ အ ဝ့ၫ ၥံၪ မွဲအနီၪလီၫ.- လၧဆၧ ၥၭထိၬအပရၧၫ့အကၠီၩ့နီၪ, အဝ့ၫၥံၪ ကဲၪထၪ့ဆၧအဒုၪ အဒၩလၧနၥံၪအဂးလီၫ. အ့ၪမွဲလၧဆၧရွံန့ အကၠီၩ့",
			"29": "<sup>29</sup> နီၪ,ဆၧအဲၪအဝ့ၫၥံၪလၧဖါၥံၪအဂးလီၫ.- အဂဲးဘဲၫ ယီၩယွၩအခိးအတၩ ဒဲအဆၧကိၭထဲၩ့နီၪ မၩကဒံၩက",
			"30": "<sup>30</sup> ဒၩအၥၭဆ့အ့ၬ.- အဂဲးဘဲၫယီၩဘဲၫလၧအခၪ့ထံၭ လၧနၥံၪလခိၭနၪဘၪယွၩတၭ, ဘိၩ့နဲၪ့ယီၩနၥံၪဒိၭန့ ဆၧယၫ့ၥၭလၧအဝ့ၫၥံၪ လနဲၩဘၪအကၠီၩ့အၥိၭနီၪ.",
			"31": "<sup>31</sup> ဘိၩ့နဲၪ့ယီၩ အဝ့ၫၥံၪလခိၭနၪဒံၭဘၪ ဆၧဘဲၫၥိၭအမိ ဒိၭန့ဆၧယၫ့ၥၭဝ့ၫ ဘဲၫနၥံၪဒိၭဆၧယၫ့ၥၭ နၥံၪအကၠီၩ့",
			"32": "<sup>32</sup> အၥိၭနီၪဆ့လီၫ.- အဂဲးဘဲၫယီၩ ယွၩဒူၭထၬၦကိၭဂၩ ဒ့ၭလၧဆၧလနဲၩဘၪအဖၧၩ့နီၪ, ဘဲၫအမိၥ့ၪယၫၦ ကိၭဂၩဒ့ၭအၥိၭလီၫ.",
			"33": "<sup>33</sup> အိ,ယွၩအဆၧထူၭဆၧလၧၫ့နီၪ, ဒဲအဆၧကိၪ့ ၥ့ၪ,ဒဲအဆၧၥ့ၪယၫနီၪ, မွဲအယိၬမၬကၨၬ အဆၧစ့ၩ",
			"34": "<sup>34</sup> ရၫ့အဂဲးနီၪၦအၪ့ဎၬမိဒၪဘၪဝ့ၫဘဲၫၥ့ၪလဲၪၬ အဖၧၩ့ ၥၭနီၪၦမိၥ့ၪယၫဝ့ၫ ဘဲၫၥ့ၪလဲၪၬ အဂဲးဘဲၫယီၩ, မွဲပလၫၥ့ၪယၫယွၩအၥၭလဂၩလဲၪ, မွဲပလၫကဲၪထၪ့ဆၧကိၪ့လိၬအၥၭ လၧအဝ့ၫလဂၩ လဲၪ.",
			"35": "<sup>35</sup> မွဲပလၫဖ့ၪဆိၫအဝ့ၫဒၪ ဘဲၫၥိၭအမိဖ့ၪလၫ့ဆၧၫ့",
			"36": "<sup>36</sup> ဝ့ၫလဂၩလဲၪ,- အဂဲးဘဲၫယီၩ ကယဲဆၧထီးအလူၬနီၪ, မွဲအကဲၪထၪ့ လၧအစူၪဖၧၩ့ ဒဲအီၪဝ့ၫလၧအကၠီၩ့, ဒဲအီၪဝ့ၫ လၧအဂးဆ့လီၫ. မွဲဆၧလၩဆၧဖၩ့အီၪလၧ အဝ့ၫဒၪအဆိၩဆိၩ အကၠၪကၠၪဆံၭ. အၩမံၩ့."
		},
		"12": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ဖုၥံၪဝဲၥံၪဧ့, ယအၪ့ကံၩ့အၪ့ ယၫနၥံၪလၧယွၩ အဆၧယၫ့ၥၭအကၠီၩ့, ဘဲၫၥိၭနၥံၪ မိအီၪက့ၪနၥံၪအမိၡါလၧဆၧလုမၧၫ့အဆံၫ့အဎံၪဆၧ",
			"2": "<sup>2</sup> ဘၪယွၩအၥၭနီၪ, နၥံၪကြၨၭမၩနၥံၪဝ့ၫလီၫ.- ထီးမၩ ဒီၩ့ၦလကၠၪဖိၪလဖၪယီၩလဂ့ၩ.- အ့ၪမွဲအၪ့လဲၩခွံၬ နၥံၪအခံးအဂၩ့ လၧဆၧမၩထဲၩ့နၥံၪအၥၭၥၫ့အဂး နီၪ,ဘဲၫၥိၭနၥံၪမိဒၪဘၪယွၩအၥၭဒဲအဆၧဂ့ၩ, ဒဲဆၧ လၧအအဲၪဒိၭဝ့ၫ, ဒဲအဆၧလၧၫ့ဆၧဎွ့ၩ နီၪဆံၭ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩ ဆၧအခိးအတၩ လၧယဒိၭန့ဘၪဝ့ၫ အကၠီၩ့နီၪ, ယစံၭကယဲၦအီၪလၧနၥံၪ အကျၩကိၭအ ဂၩဒ့ၭတၭ, ထီးအီၪက့ၪနၥံၪအၥၭ ထီၫနဲၪ့နၥံၪကြၨၭ အီၪက့ၪဝ့ၫနီၪလဂ့ၩ. အ့ၪမွဲဘဲၫယွၩဖ့ၫလၫ့ အၪ့နၩ့ ဖၭဆၧနဲၩလၧၦလဂၩဂၩအၥိၭနီၪ, အီၪက့ၪနၥံၪအ",
			"4": "<sup>4</sup> ၥၭထီးအဘၪဆံၭ.- အဂဲးဘဲၫယီၩ ဘဲၫပမိၡါလဂၩအ ဂၩ့အီၪဝ့ၫအၪမံၩ့အၥိၭနီၪ, အဂၩ့ထီးအလူၬ လဖၪ",
			"5": "<sup>5</sup> မၩဆၧလမံၩ့ဎး လမွဲဘၪတၭ,- ဘဲၫနီၪအၥိၭ ပဝ့ၫဒၪ အၪဂၩယီၩပမွဲမိၡါလဂၩဎး လၧဎရံၬအဖၧၩ့တၭ,",
			"6": "<sup>6</sup> ပမွဲပဂၩ့ဘဲၫနီၪၥိၭ ကိၭဂၩဒ့ၭ ဆုၬဆုၬဆ့လီၫ.- ဘဲၫ ဆၧဖ့ၪလၫ့ဆၧအခိးအတၩ လၧပၧၩအၥိၭနီၪ, ပအီၪ လၧဆၧဖ့ၪလၫ့လဂၩလမံၩ့, လဂၩလမံၩ့, မီၪအဆၧ မွဲဂ့ၩ, ဘဲၫဆၧနဲၩအီၪဝ့ၫအၥိၭ, မွဲပချဲၩ့လၧမီၪအချိၬ",
			"7": "<sup>7</sup> ဆံၭ.- ဆၧအခ့ၫအၡၩအဆၧမွဲဂ့ၩ, မွဲပမၩအခ့ၫအၡၩ အဆၧဆံၭ. ၦလၧအၥီၪ့ထဲၩ့ဆၧမွဲဂ့ၩ, မွဲအၥီၪ့ထဲၩ့",
			"8": "<sup>8</sup> ဒၪဝ့ၫဆံၭ.- ၦလၧအပဂၨၪထၪ့ဂူၫဂၩမွဲဂ့ၩ, မွဲအပဂၨၪ ထၪ့ဒၪဝ့ၫဆံၭ. ၦလၧအဖ့ၪလၫ့ အၪ့နၩ့ဖၭဆၧနီၪ, မွဲ အဖ့ၪလၫ့အၪ့နၩ့ဖၭ ဒၪဝ့ၫတီၩတီၩဆံၭၬ ၦလၧအယိ ဆၧနီၪမွဲအယိဆၧလၩ့ထံးလၩ့ဆ့ၭဆံၭ. ၦလၧအ ယၫ့ၥၭဆၧ မွဲအယၫ့ၥၭ ဆၧလၧအၥုၪ့ဎွံၫၥၭယီၫ",
			"9": "<sup>9</sup> ဆံၭ.- ဆၧအဲၪဆၧကွံၩနီၪမွဲအဖီၩ့ဖျ့ၭလၧဆၧအၪ့ လီၫဆံၭ. မ့ၬလဲၩ ဆၧအၧၩ့ဆံၭ. ဖီၪ့ထၬ ဆၧဂ့ၩ",
			"10": "<sup>10</sup> ဆံၭ.- လၧထၧၫ့ဖုဝဲအဲၪလိၬ ကွံၩလိၬအၥၭအဖၧၩ့နီၪ, မွဲနၥံၪမၩမုၬလၩလိၬ နၥံၪအၥၭဆုၬဆုၬတၭ,လၧ ယူၭယၪ့ဆၧအဖၧၩ့နီၪ,အီၪက့ၪဂူၫဂၩလၧယၫလခီၫ",
			"11": "<sup>11</sup> ဆံၭ.- လၧဆၧအဎၭအဖၧၩ့နီၪ, ထီးကၠႃၪ့လဂ့ၩ, လၧၥၭအဖၧၩ့နီၪ, ဂဲၩလိၬဆီၪ့နၥံၪအၥၭတၭ, မၩ",
			"12": "<sup>12</sup> ယွၩအဆၧဆံၭ.- ၥၭထိၬလၧဆၧယိလါအဖၧၩ့ ဆံၭ. အွံၪၥၭဆၧၩ့ လၧဆၧၡၪ့ဆၧနၭအဖၧၩ့ဆံၭ.",
			"13": "<sup>13</sup> ဘၩဆိၪဖၪဆၧ လၧၥၭဂုးခၧၫ့ဆံၭ.- ၦဆံၫ့ဎံၪလၧ အဘၪဆၧၡၪ့ဆၧနၭနီၪ, ဖ့ၪလၫ့အၪ့နၩ့ဖၭဆၧလၧ အဝ့ၫၥံၪဆံၭ. ၦမွံၩနီၪလုအၪ့လုအီၩအဝ့ၫၥံၪဆံၭ.",
			"14": "<sup>14</sup> ၦလၧအမၩအၧၩ့နၥံၪနီၪ, ဆိၪဂ့ၩအဝ့ၫၥံၪဆံၭးဆိၪ",
			"15": "<sup>15</sup> ဂ့ၩဆၧတၭ, ဆိၪအၧၩ့ဆၧလဂ့ၩ.- ၦလၧအၥၭထိၬလ ဖၪနီၪၥၭထိၬဎုၬလၧအဝ့ၫၥံၪအၥိၭဆံၭ. ၦလၧအဂၪ့",
			"16": "<sup>16</sup> လဖၪနီၪဂၪ့ဎုၬ လၧအဝ့ၫၥံၪအၥိၭဆံၭ.- ဆီၫ့မီၪ့ဆၧလၧ နၥံၪအၥၭ လမံၩ့ဎး ကိၭဂၩဒ့ၭဆုၬဆုၬဆံၭ. ဆီၫ့ မီၪ့လၧဆၧထၪ့ထီၫအၥၭလဂ့ၩ, ၥိၫ့နၥံၪအၥၭလၧ ဆၧဆၪ့လၩ့ဆံၭ. ထီးအီၪက့ၪ နၥံၪအၥၭ လၧနၥံၪအ",
			"17": "<sup>17</sup> ဆၧကိၪ့ၥ့ၪ ကိၪ့ဘၪဒၪဝ့ၫအဖၧၩ့လဂ့ၩ.- ထီးမၩ ဆၧၫ့ဆၧအၧၩ့လၧဆၧအၧၩ့အဂးလၧၦနးဂၩလဂ့ၩ, အၪ့ဎၬဆၧဂ့ၩဆၧဘၪ လၧၦကိၭဂၩဒ့ၭအမ့ၬယၫ",
			"18": "<sup>18</sup> နီၪဆံၭ.- အ့ၪၥ့ၪနီၪ ထီးဒၪနၥံၪမၩၥ့ၪတၭ, အီၪအိၭ",
			"19": "<sup>19</sup> လိၬနၥံၪအၥၭ လၧၦကိၭဂၩဒ့ၭဆံၭ.- ၦၥၭဘီၩ့ၥံၪ ဧ့,ထီးမၩဆၧၫ့ဆၧ လၧနၥံၪအဂးဒၪနၥံၪဝ့ၫလဂ့ၩ. အ့ၪမွဲဖ့ၪလၫ့ ဆၧၥၭထၪ့အလးဆံၭ. အဂဲးဘဲၫယီၩဆၧ ကွ့ၭအၥၭ စံၭဝ့ၫဒၪ, ဆၧ မၩ ဆၧၫ့ နီၪ အီၪ လၧ ယၧၩတၭ, ယ ဝ့ၫ ဒၪ ယမိဖ့ၪဆၧၫ့ ထဲၩ့ဆၧ",
			"20": "<sup>20</sup> လီၫ. ကဆါစံၭဝ့ၫဒၪ,- မၩအၥၭဘဲၫနီၪတၭ, နဒုၪနဒၩအ့ၪၥၭဝံအၥၭ, ဒုၭအၪ့အဝ့ၫဆံၭ. အ့ၪၥူၫအီၩအၥၭလၧထံၫ, ဒုၭအီၩအဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ နအ့ၪမၩဘဲၫနီၪတၭ, မွဲနအီၪက့ၪကီၪ့မ့ၪအၧၩ့ဖၭ လၧအခိၪဎွံၪလီၩ့လီၫ.",
			"21": "<sup>21</sup> ထီးဖ့ၪလၫ့ ဆၧအၧၩ့ မၩနၧၩ့ မၩစၪ နၥံၪလဂ့ၩ, အ့ၪမွဲမၩနၧၩ့မၩစၪ ဆၧအၧၩ့လၧဆၧဂ့ၩဆံၭ."
		},
		"13": {
			"1": "<sup>1</sup> ဆၧအစီၩ့အမၩ့အခိၪလဖၪနီၪ, မွဲၦအီၪက့ၪအၥၭ လၧအဖၫ့လၬကိၭဂၩဒ့ၭဆံၭး အဂဲးဘဲၫယီၩအ့ၪလ မွဲဘၪလၧယွၩလခီၫနီၪ, ဆၧအစီၩ့အမၩ့အီၪအ့ၬ. ဆၧ အစီၩ့အမၩ့ လၧအအီၪဝ့ၫလဖၪနီၪ, မွဲယွၩအီၪက့ၪလၩ့",
			"2": "<sup>2</sup> ဝဲၩဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလၧအပဒၩ့ထၬ ဆၧအစီၩ့အမၩ့နီၪ, မွဲအပဒၩ့ထၬဆၧ လၧယွၩအီၪက့ၪ ဝ့ၫ, ၦလၧအပဒၩ့ထၬဝ့ၫလဖၪနီၪ အနၫ့ဆါဒၪဝ့ၫမိဘၪ",
			"3": "<sup>3</sup> ထိးဆၧစ့ၩရၫ့စၪလီၫ.- အဂဲးဘဲၫယီၩ ၦဒိၪၦၡါၥံၪမၩ ၥၭမဲၪၦမၩဆၧဂ့ၩလမွဲဘၪ, မွဲၦမၩဆၧအၧၩ့လီၫ. မိ ၥၭမဲၪဘၪနၥၭ လၧဆၧအစီၩ့အမၩ့အ့ၬဧၪ. မၩဆၧဂ့ၩ တၭ,နမိဘၪဆၧစံၭထၪ့အၪ့အူၭနၧၩလၧဆၧနီၪလ",
			"4": "<sup>4</sup> မံၩ့အဂးလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫနီၪမွဲယွၩ အခ့ၫအ ၡၩ လၧနဆၧဂ့ၩအဂးလီၫ. အ့ၪမွဲနအ့ၪမၩဆၧအၧၩ့ နီၪ,ၥၭမဲၪဆၧဆံၭး အဂဲးဘဲၫယီၩ မွဲအဆိၬဖၩ့ၥံၪနၭ ၥံၪပျီၩပျီၩအ့ၬ. အဂဲးဘဲၫယီၩ မွဲယွၩအခ့ၫအၡၩ လၧ အဖ့ၪဆၧၫ့ဆၧ, လၧဆၧၥၭထၪ့အဂး လၧပမၩဆၧ",
			"5": "<sup>5</sup> အၧၩ့အလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကြၨၭအီၪ က့ၪပၥၭလၧအဖၫ့လၬန့ၫလၧဆၧၥၭထၪ့အကၠီၩ့နီၪ လကၭလၧၩ့, မွဲလၧကၪ့ၡၧၫ့အကၠီၩ့ဆ့လီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ဖ့ၪလၫ့အခီၫ့ဆ့ လၧဆၧယီၩ အကၠီၩ့ဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ မွဲယွၩ အခ့ၫအ",
			"7": "<sup>7</sup> ၡၩလၧအမၩဆၧလမံၩ့ယီၩ လထံၪဎးလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, လိၭထဲၩ့နၥံၪအဒ့ၪအမါ လၧၦၡၩကိၭအ ဂၩဒ့ၭဘီၪ. ၦလၧအကြၨၭဒိၭန့အခီၫ့နီၪ ဖ့ၪလၫ့အ ဝ့ၫဆံၭ. ၦလၧအကြၨၭဒိၭန့ အကီၭနီၪ ဖ့ၪလၫ့အဝ့ၫ ဆံၭ. ၦလၧၦကြၨၭၥၭမဲၪနီၪ, ၥၭမဲၪအဝ့ၫဆံၭ. ၦလၧ ၦကြၨၭယူၭယၪ့ဝ့ၫနီၪ ယူၭယၪ့အဝ့ၫနီၪဆံၭ.",
			"8": "<sup>8</sup> အ့ၪလမွဲဘၪဆၧအဲၪလိၬကွံၩလိၬ နၥံၪအၥၭနီၪ, ထီး အီၪလၧနၥံၪအဒ့ၪအမါနးမံၩ့လဂ့ၩ,အဂဲးဘဲၫယီၩၦ လၧအအဲၪဂူၫဂၩနီၪ, မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ယူၭ ဆၧမၪလူၬ",
			"9": "<sup>9</sup> ယူၭလီၫ.- အ ဂဲး ဘဲၫ ယီၩ ထီး မၩ မၪ ၦ မၫ ၦ ဝၩ လ ဂ့ၩ, ထီး မၩ ၥံၫ ၦ ၡၩ လ ဂ့ၩ, ထီး အၪ့ ဂူၪ ဆၧ လ ဂ့ၩ, ထီး ထိး န ၥၭ အ ဘျံၭ အ ဘျၪ လ ဂ့ၩ, ထီး ၥၭ ကွံၩ ဆၧ လ ဂ့ၩ တၭဆၧမၪလူၬအ ဂူၫဂၩလထံၪထံၪ အ့ၪအီၪနီၪ မွဲအအီၪလၧဆၧချဲၩ့လ ထံၪယီၩအဖၧၩ့, အဲၪ ၦ လၧ န နဲၩ့ ထံၭ နီၪ ဘဲၫ",
			"10": "<sup>10</sup> န နၫ့ ဆါ ဒၪ န ဝ့ၫ အ ၥိၭ ဆံၭ.- ဆၧအဲၪမၩ အၧၩ့ၦဂူၫဂၩနးမံၩ့အ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧအဲၪ နီၪ,မွဲအမၩ လၧၫ့ထၪ့ဎွ့ၩထၪ့ ဆၧမၪလူၬလီၫ.",
			"11": "<sup>11</sup> အယီၩပၥ့ၪယၫအဆၧၫ့အထီ ဒဲအမုအလၩဘၪယူၭ ဘိၩ့နဲၪ့ယီၩ, လၧပကြၨၭနၪ့ထၪ့ပၥၭ လၧဆၧမံၫအဖၧၩ့ ယူၭလီၫ. အဂဲးဘဲၫယီၩ ဘိၩ့နဲၪ့ယီၩပဆၧထိးထဲၩ့",
			"12": "<sup>12</sup> တၩ့ထဲၩ့အီၪဘူၭနဲၪ့ လၧပနဲၩၥၫ့ဆၧနီၪဒံၭလီၫ.- မုနၩ မိဖီၩ့တၭး မုဆၫဘူၭဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧခံၭအဆၧမၩလဖၪနီၪမွဲပခွံၬၡိၭၡီၩ့ဆံၭ. ဖီၪ့ထၬ",
			"13": "<sup>13</sup> ၡီၩ့ဆၧဖၩ့အစူၪဝဲၩဆံၭ.- ဘဲၫလၧမုဆၫအၥိၭနီၪ, မွဲပလ့ၩၡီၩ့ဂ့ၩဂ့ၩဘၪဘၪဆံၭ. မွဲလၧဆၧဘိၪ့ၥံၪ ပွ့ၩၥံၪအဖၧၩ့,ဆၧအီၩလၨၪၥံၭထံၫဂၬထံၫအဖၧၩ့ လမွဲဘၪး လၧဆၧမၩမၪၦမုၪၦမၧၩ့, ဒဲလၧၥၭလဲးၥၭ ဘျၪအဖၧၩ့နီၪလမွဲဘၪး လၧဆၧအဲၪ့လိၬဆိၭချဲၩ့ လိၬအၥၭ, ဒဲလၧဆၧၥၭခ့ၬလိၬအၥၭ အဖၧၩ့မွဲအ့ၬ.",
			"14": "<sup>14</sup> အ့ၪမွဲကီၩ့ၥိၭထၪ့နၥံၪဝ့ၫလၧကဆါယ့ၫရှူၬဎရံၬနီၪ ဆံၭ. ဘဲၫၥိၭနၥံၪမိမၩလၧၫ့ဎွ့ၩ ဆၧလဲးဆၧဘျၪနီၪ, ထီးမၩဆၧလၧဆၧဖံၭဆၧယၪအဂးလဂ့ၩ."
		},
		"14": {
			"1": "<sup>1</sup> ၦလၧအနဲၩဆၧဆါလဂၩနီၪ ထိးဆၧၫ့အဝ့ၫဒၪဆံၭ. မွဲလါနၫ့ဘိၩ, ဘဲၫၥိၭအမိစ့ၩရၫ့ ဆၧတ့ၭလိၬအၥၭအဂး မွဲအ့ၬ. ၦလဂၩနဲၩ လၧအကြၨၭအၪ့ဘၪ ဆၧကိၭမံၩ့",
			"2": "<sup>2</sup> ဒ့ၭလီၫ.- အ့ၪမွဲၦလၧအနဲၩဆၧဆါနီၪ, အၪ့ဆၧဒိၭဆၧ",
			"3": "<sup>3</sup> လၪလီၫ.- ၦလၧအအၪ့ဆၧနီၪ မွဲအထီးမၩကြၩ့ထမး ၦလၧအလအၪ့ဘၪဆၧနီၪလဂ့ၩ. ၦလၧအလအၪ့ဘၪ ဆၧနီၪ မွဲအထီးစ့ၩရၫ့ ၦလၧအအၪ့ဆၧနီၪလဂ့ၩ, အ",
			"4": "<sup>4</sup> ဂဲးဘဲၫယီၩ ယွၩထိးဆၧၫ့ယူၭအဝ့ၫယူၭ.- ၦလၧအစ့ၩ ရၫ့ဂူၫဂၩအဎီးအၡၩး နဝ့ၫဒၪယီၩ, နမွဲပလၫလဂၩ လဲၪ. အဝ့ၫနီၪ ဆၧၫ့ထုၪ့မွဲဂ့ၩ, လၩ့ထံၩဖါမွဲဂ့ၩ, မွဲ အအီၪဝ့ၫ လၧအကဆါဒၪဝ့ၫ အမ့ၬယၫလီၫ. ဆၧမိဒုၭ ဆၧၫ့ထုၪ့ဝ့ၫတၭ, အဂဲးဘဲၫယီၩ ယွၩဒုၭဆၧၫ့ထုၪ့ဝ့ၫ ဒၪၥ့ၪလီၫ.",
			"5": "<sup>5</sup> ၦလဂၩစ့ၩရၫ့ဝ့ၫလၧမုနံၩလနံၩနီၪဂ့ၩနဲၪ့မုနံၩအ ဂူၫဂၩဒံၭတၭး ၦလဂၩဒၪစ့ၩရၫ့ဝ့ၫ လၧအမွဲမီၪ့ဎီၩ့လီၫ. မွဲၦနဲၩဒၪဝ့ၫ လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ လၧအၥၭဒၪဝ့ၫအဖၧၩ့",
			"6": "<sup>6</sup> ကိၭဂၩဒ့ၭဆံၭ.- ၦလၧအထီးမုလနံၩနီၪ ထီးဝ့ၫလၧ ကဆါအဂးတၭ, ၦလၧအလထီးဘၪမုလနံၩနီၪ, မွဲအ လထီးဘၪဝ့ၫ လၧကဆါအဂးဆ့လီၫ. ၦလၧအအၪ့ ဆၧနီၪ, အၪ့ဆၧလၧကဆါအဂးလီၫ. အဂဲးဘဲၫယီၩ မွဲအစံၭထၪ့အၪ့အူၭယွၩ အခိးအတၩလီၫ. ၦလၧအ လအၪ့ဘၪဝ့ၫနီၪ, မွဲအလအၪ့ဘၪဝ့ၫ လၧကဆါအဂး",
			"7": "<sup>7</sup> ဒဲအၪ့အူၭထၪ့ယွၩ အခိးအတၩ ဆ့လီၫ.- အဂဲးဘဲၫ ယီၩ, ပမၧၫ့လၧပဂးဒၪပဝ့ၫနးဂၩအ့ၬ.ပၥံၫလၧပဂး",
			"8": "<sup>8</sup> ဒၪပဝ့ၫနးဂၩအ့ၬ.- အဂဲးဘဲၫယီၩ, ပအ့ၪမၧၫ့နီၪ, မွဲပ မၧၫ့လၧပကဆါအဂးတၭ, ပအ့ၪၥံၫနီၪ မွဲပၥံၫလၧပက ဆါအဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ပမၧၫ့မွဲဂ့ၩ, ပၥံၫ",
			"9": "<sup>9</sup> မွဲဂ့ၩ,ပမွဲကဆါအဆၧလီၫ.- အဂဲးဘဲၫယီၩ, ဘဲၫၥိၭအ မိကဲၪၦၥံၫဒဲၦမၧၫ့လဖၪအကဆါနီၪ,ဎရံၬၥံၫဝ့ၫတၭ, မၧၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> နဝ့ၫဒၪယီၩ မွဲဘၪနီၫလၧနစ့ၩရၫ့နထၧၫ့ဖုဝဲလဂၩနီၪ လဲၪ. နမၩကြၩ့ထမးနထၧၫ့ဖုဝဲမွဲဘၪလဲၪ. အဂဲးဘဲၫ ယီၩပဘၪဆၧၫ့ထုၪ့လၧဎရံၬ အစ့ၩရၫ့ခွး အလးဆီၩ့",
			"11": "<sup>11</sup> ဆီအမ့ၬယၫကိၭဂၩဒ့ၭလီၫ.- အဂဲးဘဲၫယီၩ ဆၧကွ့ၭ အၥၭယွၩစံၭဝ့ၫဒၪ, မွဲ ယ မၧၫ့ ယ ဝ့ၫ တၭ, က ယဲ ၦ ၡၩ အ ခၪ့ လုး ခိၪ မိ ဘၪ ထွံၩ လၩ့ လၧ ယ မ့ၬ ယၫ တၭ, က ယဲ ၦ ၡၩ အ ဖျ့ၩ မိ ဘၪ",
			"12": "<sup>12</sup> အုၩ့ လၩ့ ယွၩ ကိၭ ဂၩ ဒ့ၭ လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, ပဘၪဖ့ၪလၫ့ဆရၫ့ လၧယွၩလၧပနၫ့ဆါဒၪပ ဝ့ၫအဂး, လဂၩဘၪလဂၩ လဂၩဘၪလဂၩ ကိၭဂၩဒ့ၭ ဆုၬဆုၬလီၫ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, မွဲပထီးစ့ၩရၫ့လိၬလၧၩ့ ပၥၭ လဂ့ၩ, အ့ၪမွဲစ့ၩရၫ့အၪနဲၪ့အနီၪဒံၭ လၧဆၧဘဲၫယီၩ ဆံၭ. မွဲၦထီးအီၪက့ၪ ဆၧခၪ့ဘၪထၧၩ့ အလးမွဲဂ့ၩ, ဆၧလၩ့ထံၩဖါအလးမွဲဂ့ၩ, လၧၦထၧၫ့ဖုဝဲအဖၧၩ့ၥၭ",
			"14": "<sup>14</sup> နီၪနးဂၩလဂ့ၩ.- ယၥ့ၪယၫ, ယနဲၩလၧကဆါယ့ၫရှူၬ ဎရံၬအဖၧၩ့, ဆၧလဆံၫ့ဘၪ ဒၪအဆၧအီၪဝ့ၫ နးမံၩ့ အ့ၬ. မွဲလါနၫ့ဘဲၫနီၪတၭ, ၦလၧအဆီၫ့မီၪ့ဝ့ၫ လၧဆၧ လမံၩ့မံၩ့, မွဲဆၧလဆံၫ့ဘၪနီၪ, ဆၧနီၪမွဲဆၧလဆံၫ့ဘၪ",
			"15": "<sup>15</sup> လၧအဝ့ၫဒၪအဂးလီၫ.- နအ့ၪမၩဆၫနထၧၫ့ဖုဝဲအၥၭ လၧနဆၧအၪ့အကၠီၩ့နီၪ, နလ့ၩလၧၩ့ဘဲၫဆၧအဲၪအၥိၭ အ့ၬ. ၦလၧဎရံၬထိးၥံၫအၥၭ လၧအကၠီၩ့နီၪ, ထီးမၩ",
			"16": "<sup>16</sup> ဂၭဂီၩ့အဝ့ၫ လၧနဆၧအၪ့နီၪလဂ့ၩ.- မၩအၥၭဘဲၫ နီၪတၭ, နၥံၪအဆၧဂ့ၩနီၪ မွဲနၥံၪထီးဒုၭကဲၪထၪ့ဆၧ",
			"17": "<sup>17</sup> ဒုၪဒွ့ၪလဂ့ၩ,- အဂဲးဘဲၫယီၩ ယွၩအဘၩ့အမုး လမွဲ ဘၪဆၧအၪ့ဆၧအီၩတၭ,မွဲဆၧတီၩဆၧလီၩ့,ဒဲဆၧ ဘၪလိၬအိၭလိၬ,ဒဲဆၧၥၭထိၬလၧၥၭမုဆံၫ့ဎံၪ",
			"18": "<sup>18</sup> အဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩ ၦလၧအမၩဎရံၬ အဆၧ လၧဆၧနီၪလဖၪအဖၧၩ့တၭ, မွဲဆၧဘၪယွၩအၥၭ, ဒဲ",
			"19": "<sup>19</sup> ၦၡၩအဲၪဒိၭဝ့ၫဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭး မွဲပလီၩ့ ၡီၩ့ဆၧလၧအဘၪဆဲၫ့လၧဆၧဘၪလိၬအိၭလိၬ,ဒဲ",
			"20": "<sup>20</sup> ပဂၨၪထၪ့လိၬပၥၭဆံၭ.- ထီးမၩဂၭဂီၩ့ယွၩအဆၧ မၩလၧဆၧအၪ့အကၠီၩ့နီၪလဂ့ၩ, ဆၧထီးအလူၬ မွဲအ ဆံၫ့ဎံၪလီၫ. မွဲလါနၫ့ၦလၧအအၪ့ဆၧ ထီးအဘၪဆၧ",
			"21": "<sup>21</sup> ဘၪထၧၩ့အလးနီၪ,မွဲဆၧအၧၩ့လၧအဂးလီၫ.- အၪ့ ဆၧယၪမွဲဂ့ၩ, အီၩစဘံၭထံၫမွဲဂ့ၩ, မၩဆၧအဂူၫဂၩလၧ အဒုၭဘၪထၧၩ့ နထၧၫ့ဖုဝဲ ဒဲဒုၭလၩ့ထံၩဖါဝ့ၫ မွဲဂ့ၩ, ဒုၭလၩ့ဆါအဂဲးအဘၭမွဲဂ့ၩ, ကြၨၭလၧပဂၭဎ့ၭခွံၬအ",
			"22": "<sup>22</sup> ဝ့ၫၥံၪလီၫ. မွဲဆၧနဲၩအီၪလၧနဖၧၩ့ဆ့ဧၪ,- မွဲအအီၪ လၧနနၫ့ဆါဒၪဝ့ၫ လၧယွၩအမ့ၬယၫဆံၭ. ၦလၧအဒုၭ မၩဆၧနီၪ အ့ၪလစ့ၩရၫ့လၩ့ဘၪ အၥၭဒၪဝ့ၫတၭ,",
			"23": "<sup>23</sup> မွဲအအီၪမုၬဝ့ၫလီၫ.- ၦလၧအၥၭဂံၩ့ဂၩ့နီၪ, အ့ၪအၪ့ ဆၧတၭ, မွဲအဘၪဆၧစ့ၩရၫ့စၪလီၫ. အဂဲးဘဲၫယီၩ မွဲ အလဘၪဆဲၫ့ဘၪ လၧဆၧနဲၩတၭ, ကယဲဆၧလၧအလ ဘၪဆဲၫ့ဘၪလၧဆၧနဲၩနီၪမွဲဆၧဒဲၩဘၭလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ဘိၩ့နဲၪ့ယီၩပဝ့ၫဒၪယီၩ ပအီၪလၧပဂဲးဆီၪ့ဘၭဆီၪ့ ပဝ့ၫတၭ, မွဲပကြၨၭဆိၬၦလၧအဂဲးအဘၭလအီၪ ဘၪအဂဲးဆါအဘၭဆါလဖၪနီၪ, မွဲပထီးလီၩ့ပၥၭဒၪ",
			"2": "<sup>2</sup> ပဝ့ၫလဂ့ၩး- ၦလၧပနဲၩ့ထံၭလဂၩနီၪ, ပဝ့ၫဒၪယီၩလ ဂၩဘၪလဂၩ, မွဲပမၩဘၪအဝ့ၫဒၪအၥၭလၧဆၧဂ့ၩ",
			"3": "<sup>3</sup> အဂး, ဘဲၫၥိၭအမိထၪ့ဝ့ၫထီၫဝ့ၫဆံၭ.- အဂဲးဘဲၫယီၩ ဎရံၬနီၪ လီၩ့အၥၭဒၪဝ့ၫအ့ၬ. ဘဲၫဆၧကွ့ၭအၥၭ အ ၥိၭနီၪ,ၦ ၡၩ အ ဆၧ ဒုၪ ဒွ့ၪ နၧၩ နီၪ, မွဲ အ လၩ့",
			"4": "<sup>4</sup> ဘၪ လၧ ယ လီၩ့ လီၫ.- အဂဲးဘဲၫယီၩ ထီးဒၪဆၧ ကွ့ၭဝဲၩအၥၭ လမံၩ့လါလါနီၪ,မွဲအကွ့ၭဝဲၩဝ့ၫလၧ ဆၧၥီၪ့ဆၧၥၫ့အဂဲး, ဘဲၫလၧဆၧအွံၪၥၭဆၧၩ့ အကၠီၩ့, ဒဲဆၧမုၬလၩဘၪဆဲၫ့ လၧလံၬၥံၪလဲၥံၪနီၪ, ပအီၪလၧ",
			"5": "<sup>5</sup> ဆၧယိလါလီၫ.- ဆၧအွံၪၥၭဆၧၩ့ ဒဲဆၧမၩမုၬအ ယွၩနီၪ, မွဲအဖ့ၪလၫ့နၥံၪအၥၭဆီၫ့မီၪ့ၡီၩ့ဆၧလမံၩ့ဎး",
			"6": "<sup>6</sup> ဘဲၫယ့ၫရှူၬဎရံၬအၥိၭနီၪ,- ဘဲၫၥိၭနၥံၪမိမၩလၩဖၩ့ ယွၩ ပကဆါယ့ၫရှူၬဎရံၬ အဖါဒၪလ့ၬ လၧနၥံၪအၥၭ လဖျိၪ့ဎး,ဒဲလၧနၥံၪအနိၭ လစီၪ့ဎးနီၪဆံၭ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ထိးဆၧၫ့လိၬနၥံၪအၥၭ ဆုၬ ဆုၬဘဲၫဎရံၬထိးဆၧၫ့ပၧၩလၧယွၩအလၩအဖၩ့အ",
			"8": "<sup>8</sup> ၥိၭနီၪဆံၭ.- ယစံၭယဝ့ၫး ယ့ၫရှူၬဎရံၬ ကဲၪထၪ့ဆၧ ကူၭတရံၭ အခ့ၫအၡၩ လၧယွၩ အဆၧမွဲ ဆၧတီၩအ ကၠီၩ့, ဘဲၫၥိၭအမိဒုၭဂုးဒုၭခၧၫ့ ဆၧချဲၩ့ဝဲၩ လၧဆၧလီၩ",
			"9": "<sup>9</sup> ဘၪဖါၥံၪ,- ဘဲၫၥိၭၦဆၨၩလဖၪ မိမၩလၩဖၩ့ယွၩ ဆ့လၧအဆၧယၫ့ၥၭအကၠီၩ့, ဘဲၫဆၧကွ့ၭအၥၭအ ၥိၭနီၪ, အဂဲးဘဲၫယီၩ ယမိအုၩ့လၩ့နၧၩ လၧၦဆၨၩၥံၪအ ကျၩ, ဒဲယမိၥံၫကျံၩထၪ့နမံၩ့လီၫ.",
			"10": "<sup>10</sup> စံၭဒီၭဝ့ၫ, ၦဆၨၩၥံၪဧ့,ၥၭထိၬၡီၩ့လၧအၡၩခမျၧးၥံၪဆံၭ.",
			"11": "<sup>11</sup> စံၭဒီၭဝ့ၫ, ၦဆၨၩထီးအလူၬၥံၪဧ့, စံၭထၪ့အၪ့အူၭယွၩဆံၭ. ဒဲၦခမျၧးထီးအလူၬၥံၪဧ့, ၥံၫကျံၩထၪ့အဝ့ၫဒၪဆံၭ.",
			"12": "<sup>12</sup> မၩဒီၭလဖၧၫ့စအဲၫစ့ယၫစံၭဝ့ၫဒၪ, ယ့ၭစံၫအဝံမိအီၪထၪ့တၭ, ၦလဂၩမိဂဲထုၪ့ပၧၩ့ဘၪ ၦဆၨၩၥံၪတၭ, ၦဆၨၩၥံၪမိယိလါဆၧ လၧအဝ့ၫဒၪအဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> တၭဘဲၫၥိၭနၥံၪမိအၪထၪ့ လၧဆၧယိလါလၧၥၭမု ဆံၫ့ဎံၪအစီၩ့အမၩ့အဖၧၩ့နီၪ, ဆၧယိလါအယွၩနီၪ, မွဲအဒုၭလၧၫ့ထၪ့ဎွ့ၩထၪ့နၥံၪလၧဆၧၥၭထိၬဒဲဆၧ ဘၪလိၬအိၭလိၬ ထီးအလူၬ လၧဆၧနဲၩအဖၧၩ့ဆံၭ.",
			"14": "<sup>14</sup> ဖုၥံၪဝဲၥံၪဧ့, ယနဲၩယဝ့ၫလၧနၥံၪအဂး, လၧနၥံၪလၧၫ့ ထၪ့ဎွ့ၩထၪ့လၧဆၧဂ့ၩဆၧဘွၩ, ဒဲနၥံၪလၧၫ့ထၪ့ဎွ့ၩ ထၪ့လၧဆၧၥ့ၪယၫထီးအလူၬတၭ,နၥံၪၥီၪ့လိၪလိၬ",
			"15": "<sup>15</sup> နၥံၪအၥၭဆုၬဆုၬၥ့ၪလီၫ.- ဖုၥံၪဝဲၥံၪဧ့, လၧယဒုၭနၪ့ ထၪ့နၥံၪလၧဆၧလနၩ့နၩ့ ယကွ့ၭန့နၥံၪလၧယၥၭဒူၩ အၪနဲၪ့အနီၪဒံၭ, မွဲဆၧအခိးအတၩ လၧယွၩဖ့ၪလၫ့",
			"16": "<sup>16</sup> ယၧၩအကၠီၩ့တၭ,- ဘဲၫၥိၭယမိကဲၪထၪ့ယ့ၫရှူၬ ဎရံၬအခ့ၫအၡၩ လၧၦဆၨၩလဖၪအဂးတၭ, မၩဘဲၫ ၦလုဆၧအၥိၭ လၧယွၩအဆၧၥၭထိၬ အပရၧၫ့အဂဲး, ဘဲၫၥိၭၦဆၨၩလဖၪ အဆၧမၩဘိၪ့ဘၪဆၧမၩဆံၫ့ဎံၪ",
			"17": "<sup>17</sup> ဝ့ၫလၧၥၭမုဆံၫ့ဎံၪနီၪမိဘၪအၥၭလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယအီၪက့ၪဖိၫလိၫယၥၭ လၧယ့ၫရှူၬဎရံၬ အဖၧၩ့,လၧဆၧဘၪဆဲၫ့လၧယွၩနီၪအလးအီၪဝ့ၫ",
			"18": "<sup>18</sup> လီၫ.- အဂဲးဘဲၫယီၩ ဆၧလၧဎရံၬလမၩဘၪ လၧယစူၪ ဖၧၩ့ ဒဲဆၧမၩလၧဆၧလၩ့လိလၩ့လၭအဖၧၩ့, ဒဲၥၭမု ဆံၫ့ဎံၪအစီၩ့အမၩ့နီၪ, ဘဲၫဆၧမိဒုၭခိၭနၪ ၦဆၨၩ လဖၪလၧဆၧချဲၩ့မွဲဂ့ၩ, ဒဲလၧဆၧမၩမွဲဂ့ၩနီၪ, ယ",
			"19": "<sup>19</sup> လီၩဘၪဘုၪ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, လၧယရုစလံၫ့ အီၪဝၬဖီၩ့ဝ့ၫထီၩ့လၧအလံရကၧၫ့နီၪ, ယလီၩလၩ့လၬ လၩ့ယူၭဎရံၬအဆၧၥၭထိၬအပရၧၫ့လၧၫ့လၧၫ့ဎွ့ၩ",
			"20": "<sup>20</sup> ဎွ့ၩယူၭ.- ဘဲၫနီၪအၥိၭ ယအၪ့ဂူၬလီၩလၩ့ ဆၧၥၭထိၬ အပရၧၫ့ ထီးၦလကိၭထၪ့ဘၪ ဎရံၬအမံၩ့အလး, ဘဲၫ ၥိၭယထီးမၩဘၪဆၧလၧဂူၫဂၩမၩဝဲၩအလးလဂ့ၩ",
			"21": "<sup>21</sup> လီၫ.- မွဲလါနၫ့ဘဲၫဆၧကွ့ၭအၥၭအၥိၭနီၪ, ၦလၧဆၧလလီၩဘၪ အဂဲးလဖၪနီၪ, မိဒၪဘၪဝ့ၫ တၭ, ၦလၧအလနါဂၧၫ့ဘၪဝ့ၫလဖၪနီၪ, နၪဝ့ၫမိၥ့ၪလီၫ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭယထီးလ့ၩ လၧနၥံၪ အအီၪလဂ့ၩနီၪ ဆၧမၩထံၬထၬယၧၩအၪမၬလီၫ.",
			"23": "<sup>23</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယအီၪထီးခးလဖၪယီၩ အလးအီၪ လၧၩ့အ့ၬ. တၭဆၧမိလ့ၩအီၪၡီၩ့ဘၪယၥၭ လၧနၥံၪ",
			"24": "<sup>24</sup> အၪနံၪ့ယူၭတၭ,- ထီးယအ့ၪလ့ၩ လၧစပံၫ့တၭ, ယယိ လါယမိဒၪဘၪနၥံၪ လၧယလ့ၩဆၧအဘိၩ့ဘၭနီၪ, ယ အီၪၡီၩ့နၥံၪ ဘျဲၩအီၪၡီၩ့ဂီၩ့နီၪနၥံၪမိၥိၫ့ယၧၩလၧ",
			"25": "<sup>25</sup> နီၪလီၫ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ဘဲၫၥိၭယမိမၩ ၦဆံၫ့ဎံၪ",
			"26": "<sup>26</sup> လဖၪအဆၧတၭ, ယလ့ၩလၧယရုစလံၫ့လီၫ.- အ ဂဲးဘဲၫယီၩ ဘၪၦမၫစဒိနအၫဖိၪဒဲၦအခ့ယၫဖိၪလဖၪ အၥၭဘဲၫၥိၭအမိဖ့ၪယုဆၧလၧၦဆံၫ့ဎံၪဘၪၡၪ့ဘၪ",
			"27": "<sup>27</sup> ယၬလၧယရုစလံၫ့အဖၧၩ့လီၫ.- ဘၪအဝ့ၫၥံၪအၥၭနီၪ, အဂဲးဘဲၫယီၩ အဒ့ၪအမါ အီၪလၧအလီၩ့လီၫ. အဂဲး ဘဲၫယီၩ ၦဆၨၩလဖၪအ့ၪန့ဎုၬ ၦယုဒၫဖိၪအစူၪလးအ ခၪ့ခိၪလၧအဘၪဆဲၫ့ လၧၥၭနီၪတၭ, အဝ့ၫၥံၪကြၨၭလု အၪ့လုအီၩ ၦၡၩၥံၪနီၪ လၧအစူၪလး အခၪ့ခိၪ လၧ",
			"28": "<sup>28</sup> အဘၪဆဲၫ့ လၧဆၧဖံၭဆၧယၪဆ့လီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယမၩဆၧယီၩအ့ၪဂီၩ့ ဒဲစဲၩနဲၪ့ထၬဆၧၥၪ ယီၩလၧအဝ့ၫၥံၪအဂးတၭ, ယမိလ့ၩလၧနၥံၪအအီၪ",
			"29": "<sup>29</sup> ထီၩ့လၧစပံၫ့လီၫ.- ထီးယအ့ၪလ့ၩထီၩ့လၧနၥံၪအအီၪ နီၪ, ယမိလ့ၩလၧဎရံၬအဆၧၥၭထိၬအပရၧၫ့အဆၧ ဆိၪဂ့ၩ, လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩနီၪယၥ့ၪယၫလီၫ.",
			"30": "<sup>30</sup> ဖုၥံၪဝဲၥံၪဧ့, ဘဲၫဆၧမိမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧၦ",
			"31": "<sup>31</sup> လနဲၩဘၪဆၧ လၧခးယုဒၫအဖၧၩ့နီၪ,- ဒဲဘဲၫၥိၭယမၩ ဆၧလၧယရုစလံၫ့ဖိၪ အဂးနီၪ, မိဘၪ ၦဆံၫ့ဎံၪၥံၪအ",
			"32": "<sup>32</sup> ၥၭဒဲလခီၫအ့ၪဘၪယွၩအၥၭ,- ဘဲၫၥိၭယမိလ့ၩလၧ ယၥုၪ့ထိၬၥၭထိၬ လၧနၥံၪအအီၪမုၬလၩ ဆၧလၧနၥံၪ အၥိၭနီၪ, ယအၪ့ကံၩ့အၪ့ယၫနၥံၪ လၧပကဆါယ့ရှူၬ ဎရံၬအကၠီၩ့,ဒဲဆၧအဲၪဘၪဆဲၫ့လၧၥၭမုအကၠီၩ့ဘဲၫ ၥိၭနၥံၪမိအၪ့ကံၩ့ အၪ့ယၫန့ၡီၩ့ယဂး လၧနၥံၪအဆၧ",
			"33": "<sup>33</sup> ဘၩဆိၪဖၪအဖၧၩ့ လၧယွၩဆီၪ့ဆီၪ့လီၫ.- ဆၧဘၪလိၬ အိၭလိၬအယွၩနီၪ, မွဲအအီၪလၧနၥံၪဝ့ၫထီးအလူၬ အၥိၭဆံၭ. အၩမံၩ့."
		},
		"16": {
			"1": "<sup>1</sup> ယအီၪက့ၪ ထၧၫ့ဖုဝဲမုၪ လၧအမွဲဆၧအီၪကီၪ့လၧ စံၪ့ခြံအၫအဖၧၩ့ အခ့ၫအၡၩ နးဖံဘံၫလၧနၥံၪအမ့ၬ",
			"2": "<sup>2</sup> ယၫ,- ဘဲၫၥိၭနၥံၪမိထိးဆၧၫ့အဝ့ၫလၧကဆါအဖၧၩ့ ဘဲၫအကြၨၭ လၧၦဆံၫ့ဎံၪအၥိၭနီၪ, ထီးဒၪၦမၩဆၧၩ့ ဝ့ၫအလးအ့ၪအီၪနီၪ, မၩဆၧၩ့အဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫလဂၩအနၫ့ဆါဒၪဝ့ၫနီၪ မၩဆၧၩ့ယူၭၦအၪ",
			"3": "<sup>3</sup> ဂၩတၭ, ဒဲယနၫ့ဆါဒၪယဝ့ၫဆ့လီၫ.- ချဲၩ့ဒုၪ့ၦလၧအ မၩဎုၬဆၧလၧယၧၩ လၧယ့ၫရှူၬဎရံၬအဖၧၩ့, နးပြံၫစံ",
			"4": "<sup>4</sup> လၫ,ဒဲစအကွံလၫဆံၭ.- (အဝ့ၫၥံၪအီၪက့ၪလၩ့အခိၬ လၧယၥၭမၧၫ့အဂးလီၫ. အခိးအတၩ ၦအၪ့အူၭထၪ့ န့ၫယၧၩလဂၩ လကၭလၧၩ့း မွဲဆၧအီၪကီၪ့အီၪလၧၦ",
			"5": "<sup>5</sup> ဆၨၩလဖၪအကျၩ ထီးအလူၬဆ့လီၫ.)- ချဲၩ့ဒုၪ့ဆၧ အီၪကီၪ့လၧအဂံၪ့ဖၧၩ့ဆံၭ. ချဲၩ့ဒုၪ့ၦလၧယအဲၪဝ့ၫ, ခးအ့ၡၫအဆၧၥၪဆိၫ လၧဎရံၬအဖၧၩ့, စအ့ၫပနံတၧၭ",
			"6": "<sup>6</sup> ဆံၭ.- ချဲၩ့ဒုၪ့ၦလၧအမၩဆၧ လၧယဂးအၪမၬ နးမၫ",
			"7": "<sup>7</sup> ရံၫဆံၭ.- ချဲၩ့ဒုၪ့ၦလၧအလၩ့ဎုၬ လၧထီၫ့ဖၧၩ့ လၧယ ၥိၭ, ထၧၫ့ဘူၭထၧၫ့ထံးလၧယၧၩ, စအၫ့ဒြီနကၧၭ, ဒဲ စယုနအၫလဖၪ လၧအလၩအဖၩ့ အီၪလၧၦဆၧအၪ့ မၧၫ့ဖိၪလဖၪအကျၩ, ဒဲအီၪဆိၫနဲၪ့ယၧၩ လၧဎရံၬအ",
			"8": "<sup>8</sup> ဖၧၩ့ဆံၭ.- ချဲၩ့ဒုၪ့ၦလၧ ယအဲၪဝ့ၫ လၧကဆါအဖၧၩ့,",
			"9": "<sup>9</sup> စအၪ့ပျအၧၭဆံၭ.- ချဲၩ့ဒုၪ့ ၦလၧအမၩဎုၬဆၧလၧ ယၧၩလၧဎရံၬအဖၧၩ့,စအၧဘၫ့, ဒဲၦလၧယအဲၪဝ့ၫ",
			"10": "<sup>10</sup> စတ့ခံၭဆံၭ.- ချဲၩ့ဒုၪ့ၦလၧအဘၪ ဆၧအဲၪဒိၭဝ့ၫလၧ ဎရံၬအဖၧၩ့ စအပ့လံၭဆံၭ. ချဲၩ့ဒုၪ့ၦလၧအဘၪဆဲၫ့",
			"11": "<sup>11</sup> လၧစအရံစတီၫဘုလၭလဖၪဆံၭ.- ချဲၩ့ဒုၪ့စဟရီဒအၫ့ လၧအထၧၫ့ဘူၭထၧၫ့ထံး လၧယၧၩဆံၭ. ချဲၩ့ဒုၪ့ၦအီၪ လၧကဆါအဖၧၩ့ လၧအဘၪဆဲၫ့ လၧစနၫစံစၧၭလဖၪ",
			"12": "<sup>12</sup> ဆံၭ.- ချဲၩ့ဒုၪ့ၦလၧအမၩဆၧ လၧအကဆါအဖၧၩ့, နးတြဲၫဖံနၫ ဒဲနးတြဲၫဖိစၫဆံၭ. ချဲၩ့ဒုၪ့ၦလၧဆၧအဲၪဝ့ၫ လၧအမၩဆၧအၪအၪလ့ၬ လၧကဆါအဖၧၩ့, နးပၧစံၭ",
			"13": "<sup>13</sup> ဆံၭ.- ချဲၩ့ဒုၪ့ၦဘၪဆၧရွံန့ဝ့ၫ လၧကဆါအဖၧၩ့, စရု",
			"14": "<sup>14</sup> ဖၧၭဒဲအမိဒဲယမိဆ့ဆံၭ.- ချဲၩ့ဒုၪ့စအစံၪ့ကြတၧၭ,ဒဲ စဖျ့ၭဂၧၫ့, စဟၧမံၭ, စပတြီဘၭ, စဟၧမၭ, ဒဲထၧၫ့ဖုဝဲ",
			"15": "<sup>15</sup> အီၪလၧအဝ့ၫၥံၪအၥိၭဆံၭ.- ချဲၩ့ဒုၪ့စဖလီလဂၧၭ, ဒဲ စယုလအၫ, စနံရအၧၭ, ဒဲအထၧၫ့ဖုဝဲမုၪ, ဒဲစအိၫလံၪ့ ပၭ, ဒဲၦဆံၫ့ဎံၪ ထီးအလူၬ လၧအဝ့ၫၥံၪ အၥိၭဆံၭ.",
			"16": "<sup>16</sup> ချဲၩ့ဒုၪ့လိၬ နၥံၪအၥၭ လၧဆၧအဲၪဂါ ဆံၫ့ဎံၪဆံၭ. ဎရံၬအဆၧအီၪကီၪ့ထီးအလူၬချဲၩ့ဒုၪ့နၥံၪလီၫ.",
			"17": "<sup>17</sup> ဖုၥံၪဝဲၥံၪဧ့, ယအၪ့ယၫနၥံၪဘဲၫၥိၭ နၥံၪမိထီးနဲၪ့ ၦလၧအမၩဆၧလၩ့မုလၩ့ဖၭ,ဒဲအီၪက့ၪဆၧလၩ့ထံၩ ဖါအလးလမွဲဘၪ ဘဲၫဆၧၥီၪ့ဆၧၥၫ့ၥံၪ လၧနၥံၪမၩလိၪ",
			"18": "<sup>18</sup> အၥိၭ, ဂၭဎ့ၭခွံၬအဝ့ၫၥံၪဆံၭ.- အဂဲးဘဲၫယီၩ ၦဘဲၫ နီၪၥိၭလဖၪ လမၩဘၪပကဆါ ယ့ၫရှူၬဎရံၬ အဆၧ တၭ,မွဲအဂူၭဖိၫ့ဒၪဝ့ၫအဆၧလီၫ. အဝ့ၫၥံၪအၪ့လီၫန့ ၦလၧအလထီးလၩ့ဘၪ အၥၭလဖၪ လၧဆၧချဲၩ့အဂ့ၩ,",
			"19": "<sup>19</sup> ဒဲဆၧချဲၩ့မုၬနါအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩနၥံၪခိၭနၪ ဆၧနီၪဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫလၧၦထီးအလူၬအကျၩ လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယၥုၪ့ထိၬၥၭထိၬ လၧနၥံၪ အကၠီၩ့လီၫ. ယဆိၫ့လၧနၥံၪအၥၭမိဖၭလၧဆၧဂ့ၩအ ဂးတၭ, ဒဲၥၭလဖၭဘၪလၧဆၧအၧၩ့အဂးလီၫ.",
			"20": "<sup>20</sup> ဆၧဘၪလိၬအိၭလိၬအကဆါနီၪ မိမၩလၩ့ဘျ့ၭမုၪ ခီၩလဲး,လၧနၥံၪအခၪ့ဖၫ့လၬ ချဲၫ့ချံၭလီၫ. ပကဆါ ယ့ၫရှူၬဎရံၬ အခိးအတၩမွဲအအီၪလၧ နၥံၪအၥိၭ ဆံၭ. အၩမံၩ့.",
			"21": "<sup>21</sup> ၦမၩဎုၬဆၧ လၧယၧၩစထံမၥံၫဒဲၦထၧၫ့ဘူၭထၧၫ့ ထံးလၧယၧၩ စလုစအၧၭ, စယ့စၧၫ့,ဒဲစစီၫစပၫဘၧၫၥံၪ",
			"22": "<sup>22</sup> ချဲၩ့ဒုၪ့နၥံၪလီၫ.- ၦလၧအကွ့ၭလံၬယီၩ, ယၧၩ, စတၧ",
			"23": "<sup>23</sup> ၡၧၭချဲၩ့ဒုၪ့နၥံၪ လၧကဆါအဖၧၩ့လီၫ.- ၦလၧအထိး ဆၧၫ့လုအၪ့ယၧၩ စဂ့အၧၭ,ဒဲဆၧအီၪကီၪ့ထၧၫ့ဒီၪ့ ယၫချဲၩ့ဒုၪ့နၥံၪလီၫ.- ၦယိဒီၩ့စအံၫရၭစတၧၭ,ဒဲ",
			"24": "<sup>24</sup> ထၧၫ့ဖုဝဲခွၫစကွီတၧၭ, ချဲၩ့ဒုၪ့နၥံၪလီၫ.- ပကဆါယ့ၫ ရှူၬဎရံၬ အခိးအတၩ မွဲအအီၪ လၧနၥံၪထီးအလူၬအ ၥိၭဆံၭ. အၩမံၩ့.",
			"25": "<sup>25</sup> ၦလၧအမၩဂုးမၩခၧၫ့ နၥံၪၥ့ၪဘဲၫယဆၧၥၭထိၬ အပရၧၫ့, ဒဲယ့ၫရှူၬဎရံၬ အဆၧလီၩလၩ့လၬလၩ့အၥိၭနီၪ, အီၪၥူၪအီၪဘံၭဝ့ၫ အဆိၩဆိၩအကၠၪကၠၪ လၧဖျိၩ့",
			"26": "<sup>26</sup> လံၩလံၩလအီၪဖျီၪဘၪနီၪ,- မွဲလါနၫ့ဘိၩ ဆၧမၩဖျီၪ ထၪ့ဘိၩ့နဲၪ့ယီၩ,လၧမီၪလဖၪ အဆၧကွ့ၭ အၥၭ ဘဲၫယွၩအဆိၩအကၠၪ အဆၧမၪလူၬအၥိၭနီၪ, ဆၧဒုၭ ၥ့ၪယၫၦကိၭဆၨၩဒ့ၭလၧဆၧခိၭနၪဘၪဆဲၫ့လၧ",
			"27": "<sup>27</sup> ဆၧနဲၩအဂး,- ယွၩလၧအကိၪ့ၥ့ၪလဂၩဎးနီၪ,မွဲအ ဘၪဆၧအလၩအဖၩ့ လၧယ့ၫရှူၬဎရံၬအကၠီၩ့အဆိၩ ဆိၩအကၠၪကၠၪဆံၭ. အၩမံၩ့."
		}
	}
};
module.exports = book;